INSERT INTO `chapter_public_pages` (`id`, `pname`, `officer_id`, `title`, `content`, `created_at`, `updated_at`) VALUES
(1, 'about', 14, 'About Sigma Tau', '<p style="text-align:center"><img alt="" src="http://dke.mit.edu/assets/skyline-0e0ca9e9153863a36a1826aa9063cc1f.jpg" style="height:298px; width:1100px" /></p>\r\n\r\n<p>The Sigma Tau Chapter of Delta Kappa Epsilon is a fraternity at the Massachusetts Institute of Technology. DKE was chartered on November 14th, 1890 as the tenth MIT fraternity. It was founded by members of a local society, Alpha Gamma Kappa, that had been established to petition for a new DKE charter.<br />\r\n<br />\r\nToday, the DKE house stands in the middle of the West Campus, along dorm row between Baker House and Burton-Conner, along with a few fellow fraternities. DKEs are actively involved in all facets of campus life from varsity and club athletics, to The Tech, to community service</p>\r\n\r\n<h2>History of Delta Kappa Epsilon</h2>\r\n\r\n<p><img alt="" src="http://dke.mit.edu/assets/dkecrestold-f1128b640a1c22270e852c8767fb63e7.png" style="float:left; height:226px; margin-left:20px; margin-right:20px; width:195px" /> In the spring of 1844 at Yale College in New Haven, Connecticut, a number of men of high character and scholastic attainment did not receive bids from the campus&#39; two fraternities. This unfair act, which was due to undergraduate politics and a division in the Sophomore class, caused some men who did in fact receive bids to promptly reject them. Together, these men created a new society, founded in a meeting on June 22, 1844 in room Number 12, Old South Hall. Here, both the fraternity&#39;s secret and open Greek mottos were devised. The open motto being &quot;Kerothen Philoi Aei,&quot; which in English means &quot;Friends from the Heart, Forever.&quot; The DKE pin was also created with the Greek letters of DKE on a white scroll upon a black diamond with a gold rope trim and a star in each corner, as well as the colours crimson, blue, and gold. The chapter started with it&#39;s 15 founders deeming itself Phi of Delta Kappa Epsilon. To this day, it is the only fraternity at Yale that has never gone inactive. Within three years, chapters were founded at Bowdoin, Princeton, Colby College, and Amherst College. Since that time, DKE has grown to over 64 chapters and initiated over 85,000 members across North America. The fraternity is inextricably linked to the history of the United States of America, as its members include a whopping 5 of the 44 presidents, including both George Bush&#39;s Rutherford B. Hayes, Teddy Roosevelt, and Gerald Ford. The first west coast chapter was founded at UCal Berkeley in 1876, which was followed by their rival Stanford in 1901. DKE became an international fraternity with the addition of the Alpha Phi chapter in 1898 at the University of Toronto in Canada.</p>\r\n', '2015-01-26 06:13:30', '2015-05-16 09:50:22'),
(2, 'letter', 1, 'A Letter from the DKE President', '<p>Greetings,</p>\r\n\r\n<p>First of all, thank you for visiting the Sigma Tau chapter website. I hope that you have been able to find all of the information you desired in visiting.</p>\r\n\r\n<p>I am very proud to say that over the past year our chapter has continued its tradition of excellence and leadership on the MIT campus. This was made possible by a dedicated and passionate group of actives in addition to the outstanding officers who have served with me over the past semester.</p>\r\n\r\n<p>Jake Laux &#39;14 has done an excellent job as the chapter&#39;s Vice President and Risk Manager, ensuring that our social events occur in a safe and responsible manner. John Halloran &#39;15, the House Treasurer, has been outstanding with the extremely challenging job of managing the chapter&#39;s finances. Joe Cunningham &#39;16 has done very well as House Manager, keeping the house clean in addition to maintaining and updating it. Luther Banner III &#39;16, the house Social Chair, did a great job of occasionally taking our minds of academics with an assortment of parties and mixers over the course of the semester. Last but certainly not least, Doug Nmagu &#39;14, the House Steward, has done an exceptional job in ensuring that the brothers are happy with the meal plan and formal, along with keeping a close relationship with our chef, Dan West.</p>\r\n\r\n<p>If you come by the DKE house this year, you will see some new faces. Thanks to our recruitment chair, Will Waste &#39;14, we had a successful rush in 2013 that resulted in 12 new members pledging Delta Kappa Epsilon. We are very excited to welcome Andrew Titus, Bradley Walcher, Christian Argenti, Christopher Sanfilippo, David Houle, Kevin Kusch, Matthew Iovino, Matthew Lindsay, Ryan Karnish, Seth Studebaker, and Travis Herbanek as the Sigma Tau pledge class of 2016.</p>\r\n\r\n<p>As always, the brothers of Delta Kappa Epsilon at MIT have continued their participation and leadership in athletics. The MIT Football team, which finished the season with 6 wins this year, sported 37 DKE brothers and pledges, including 3 brothers as team captains. In 2013, DKE saw 9 brothers earning ALL-NEFC honors and 3 brothers earning Academic All-District honors. One of our brothers, Joesph Campion &#39;15, is helping represent MIT as a member of the Basketball team. Tim Wilson &#39;14 will continue his role as a relief pitcher for the baseball team this spring when practice resumes. Actives Ben Greenberg &#39;15, and alumni Will Vega-Brown &#39;11 all still actively participating in MIT&#39;s Jiu Jitsu club. Finally, Cosma Kufa &#39;16, our chapter&#39;s Intramural Chair, has done a great job increasing our involvement in intramural sports at MIT.</p>\r\n\r\n<p>As we look forward to a new year, we perform the sad duty of saying goodbye to the senior class. Many of the graduating class are leaving MIT to start their careers in a number of different fields, and the rest will be off to graduate school. Whatever their destination, we wish them the best of luck and hope they will always remember the good times they had here at Delta Kappa Epsilon.</p>\r\n\r\n<p>Justin Wallace &#39;15</p>\r\n\r\n<p>President, Delta Kappa Epsilon, Sigma Tau Chapter</p>\r\n', '2015-01-26 06:13:30', '2015-01-26 06:13:30'),
(3, 'summer_housing', 13, 'false', '<p><span style="font-size:36px">We are <u><strong>Full</strong></u> for Summer 2015.</span></p>\r\n\r\n<p>Delta Kappa Epsilon is located at 403 Memorial Drive in Cambridge, MA on the MIT campus. We are conveniently located a short walking distance from both local bus and subway public transportation systems. During the summer of 2015&nbsp;our rent period will be from Sunday, May 24&nbsp;until Wednesday, August 12.</p>\r\n\r\n<p>We are currently renting out 4 types of rooms: singles, doubles, triples and one quad. Rates for each of the following room types are as follows: singles are $2600, doubles are $2000, triples are $1800 and the quad is $1500. These prices are per person for the entire 11 week renting period. Both singles and doubles are one room, where singles are about 2/3 the size of doubles . Triples are essentially two-room suites, containing a front room that typically serves as a public area and a back room that is often used as a bedroom. These rooms contain one door that is located in the front room and one door connecting the front room to the back room. The quad is approximately the size of two large doubles and is one room</p>\r\n\r\n<p>Our house contains five-stories, with residential rooms available on the third, fourth, and fifth floors. Each residential floor has one restroom outfitted with three sinks, one full size mirror, one urinal, one stall, and one shower. The first floor contains our full size and fully-equipped kitchen, including industrial sized refrigerator and freezer, which are available for lessee use. We also have a laundry room available with both a new high efficiency washer and dryer at no additional charge. The second floor contains the main common areas of the house: a large dining room, a pantry equipped with dinnerware for general use and a dish washer, a living room with sofas, and a library full of books suitable for both leisure and education. Our house is secured by a front door system that requires a code to enter, and each residential room is individually lockable to help ensure the safety of you and your belongings. Our prices include all utilities and rent for the entire renting period specified above. Additional amenities provided at no further cost include high speed wireless and wired internet and DirecTV service with premium movie channels. Each lessee is provided a full or twin extra long mattress and bed frame. Most rooms are furnished with sofas, dressers, desks, coffee tables, office chairs, lamps and air conditioning units. Other furniture and appliances can be found around the house and used to furnish one&rsquo;s room on a first-come-first-serve basis.&nbsp;</p>\r\n', '2015-01-26 06:13:30', '2015-06-01 16:58:21');
