INSERT INTO `summer_housing_applications` (`id`, `first_name`, `last_name`, `sex`, `age`, `email`, `phone`, `school`, `year`, `dke_brother`, `q1`, `q2`, `q3`, `q4`, `q5`, `q6`, `q7`, `q8`, `room_pref`, `finding`, `lived_before`, `car`, `contacted`, `created_at`, `updated_at`) VALUES
(1, 'Monica ', 'Gates', 'female', 21, 'mgates@wellesley.edu', '6125848675', 'Wellesley College', 4, 'I am not a brother', 'research at MIT, Building 46', 'laid back', 'Work, work out, come back to the room and hang out', 'Walk to Haymarket and Chinatown for groceries, wander around Boston', 'Great location, good pricing', 'n/a', 'Theta Chi', '', 3, 'Web Search', 0, 0, 0, '2015-01-31 21:53:01', '2015-02-27 01:30:55'),
(2, 'Camille', 'Frankenfield', 'female', 20, 'cmf5508@psu.edu', '7176457676', 'Penn State', 3, 'I am not a brother', 'I''m interning with Hilton at their Doubletree Cambridge property in Event Services', 'I''m a very outgoing person but I also like my alone time.  I like being in a mixed group of personalities, whether that''s in a large group setting or just chilling for a night.', 'Working, going to class, club meetings and school works.  Sometimes going out on a Thursday', 'Work, homework, netflix binging, going out at night.', 'Last summer I lived alone while interning and it was incredibly lonely.  I want to live somewhere with a social and laid back atmosphere.  Somewhere friendly but also laid-back; people hang out but also enjoy having their own space.', 'No', 'No', 'I think I''m able to fit in in pretty much all social environments.  I keep my space tidy but I don''t mind if other people are messy.  ', 3, 'Web Search', 0, 0, 0, '2015-02-15 23:28:22', '2015-02-27 01:21:45'),
(3, 'Allison', 'Ryder', 'female', 20, 'aryder1@swarthmore.edu', '9132072398', 'Swarthmore College', 2, 'I am not a brother', 'System Software Engineering Intern at Akamai Technologies located in Cambridge', 'I''m pretty laid back but I do like to have fun!', 'Well right now during the semester, I typically spend weekdays doing homework... and hanging out with friends when I get the chance', 'On the weekends, I really enjoy doing outdoor activities like going rock climbing, skiing, hiking, etc. I also like to go out with friends and have a good time!', 'I would like it to be a safe environment with fun people to hang out with', 'Alex Souvannakhot possibly, and I would be interested in sharing a double', 'N/A', 'N/A', 2, 'Web Search', 0, 0, 0, '2015-02-16 02:01:22', '2015-02-27 02:04:50'),
(4, 'Grainne', 'Bonner', 'female', 21, 'grainnebonner93@hotmail.com', '0877775494', 'Institute of Technology Blanchardstown ', 4, 'I am not a brother', 'waitressing in the Whiskey Priest', 'I am a very outgoing friendly person.', 'If I''m not working I love shopping and going out with my friends on a Saturday night', 'working, shopping with friends and heading out on a Saturday night', 'I would love to spend my summer making new friends in a warm friendly atmosphere', 'Yes, my friend Emma Ryan who I am travelling to Boston with who is also from Ireland', 'I have never stayed in one before', 'I would love to have the opportunity to spend the summer here, making new friends and new experiences ', 2, 'Friend', 0, 0, 0, '2015-02-17 14:55:11', '2015-02-27 02:04:48'),
(5, 'Zachary', 'Zagorski', 'male', 19, 'zachary_zagorski@brown.edu', '5162362319', 'Brown University', 2, 'I am not a brother', 'Software engineering internship at Onshape - across the street from Alewife T station', 'I''m fairly friendly, can be laid-back at times.', 'Classes, homework, crossword puzzles, Mario Kart, playing my cello, cooking.', 'Cook tons of food, share most of it with friends.', 'Affordable rent, walking distance to the Red Line, and all the simple comforts of home - a kitchen and a community.', 'Alex St. Laurent, and yes.', 'N/A', '', 2, 'Web Search', 0, 0, 1, '2015-02-23 04:28:14', '2015-03-16 23:29:02'),
(6, 'Alexander', 'St Laurent', 'male', 21, 'awstlaur@techhouse.org', '7742896383', 'Brown University', 3, 'I am not a brother', 'Software Engineering at Athenahealth in Watertown.', 'Mostly outgoing once I''m comfortable with people.', 'Go to work, have dinner, do some crossword puzzles and/or video games.', 'Sleep in!', 'Near the T.', 'Zach Zagorski and I would like to live together, preferably in a double.', 'n/a', 'n/a', 2, 'Friend', 0, 0, 1, '2015-02-23 06:43:47', '2015-03-16 23:29:03'),
(7, 'Eimear', 'Flynn', 'female', 20, 'Flynne4@tcd.ie', '0833283857', 'Trinity College Dublin', 2, 'I am not a brother', 'Waitressing', 'Outgoing, sociable, easy to get along with', 'I have college during the day. In the evenings I tend to meet up with friends and participate in various activities.', 'At the weekend I catch up with friends and go out with them. I also work some weekends.', 'Ideally I would love to live in a house such as this. I feel it would suit me as I enjoy meeting new people and there would be constantly people to talk to and hang out with. I spent the summer abroad last year and met people from all over the world and feel that living in this house would allow me to do so again.', 'Yes. I have two friends who also wish to apply for housing. Ideally we would like to share a triple room. Their names are Irene Brockie and Catherine Hearn.', 'I have not stayed in a fraternity before.', '', 3, 'IFC Website', 0, 0, 0, '2015-02-23 15:20:29', '2015-02-27 01:16:09'),
(8, 'Ryan', 'Hickey', 'male', 22, 'rhickey@uwm.edu', '2242348900', 'University of Wisconsin-Milwaukee', 4, 'I am not a brother', 'Research with Professor Chang in the Materials Science Department at MIT', 'Outgoing, Enjoy anything from chilling on the couch to going to Concerts or sporting events...', 'During Summer: Work during the day, basketball and working out at night...', 'Organized Sports, Social Drinking, sporting events, etc', 'Social Environment', 'n/a', 'n/a', 'I would prefer a single room if it is an option.', 2, 'Web Search', 0, 1, 1, '2015-02-24 21:31:39', '2015-03-16 23:34:22'),
(9, 'Alison', 'Abrams', 'female', 20, 'abrams_alis@bentley.edu', '5166725951', 'Bentley University', 3, 'I am not a brother', 'Analyst Development Program at Liberty Mutual on Berkeley Street', 'Outgoing', 'Going to class/work, hanging out with roommates at night.', 'Spend time with friends/go out. ', 'With my two other friends looking for housing in Boston', 'My friends Morgan Mazone and Jill Raia are most likely living in Boston this summer and yes  I would like to live with them in the same room.', 'No', '', 3, 'Web Search', 0, 1, 1, '2015-02-25 22:10:01', '2015-02-27 01:31:09'),
(10, 'Shannen', 'McLaughlin', 'female', 20, 'shannen-07@hotmail.com', '0879954815', 'University of Limerick, Ireland.', 4, 'I am not a brother', 'Summer employment from Ireland.', 'I enjoy meeting new people and socializing. I would consider myself  outgoing and energetic. I look forward to new experiences.', 'I enjoy playing most sports and during the college term I tend to be busy with sports and college work.', 'I like meeting with friends, go out, outdoor pursuits and sports.', 'Fun, experiencing new things, meeting new people.', 'I intend to travel with 3 friends. We would all like to live together. Their names are Adele Leogue, Laura Leogue and Jennifer Sheehan.', 'No\r\n', 'Do you normally rent the house to Irish students during the summer periods?', 4, 'IFC Website', 0, 0, 0, '2015-02-26 15:04:56', '2015-02-27 01:16:08'),
(11, 'Jennifer', 'Bleck', 'female', 21, 'jbleck@villanova.edu', '9784602967', 'Villanova University', 3, 'I am not a brother', 'I have an internship in wealth management this summer. It''s located in the Financial District.', 'I''m very outgoing and friendly. I like to meet new people and go out.', 'During the week, I usually do work and go spinning. ', 'Go out to the bars with friends. ', 'I want to live somewhere that is pretty clean. I''m pretty laid back and I''m flexible.', 'No.', 'No.', 'No.', 2, 'Friend', 0, 0, 1, '2015-02-27 00:19:35', '2015-02-27 02:14:18'),
(12, 'Hannah', 'Brewster', 'female', 19, 'hbrewste@wellesley.edu', '7742622380', 'Wellesley College', 2, 'I am not a brother', 'Internship or summer class; Boston area', 'Enjoy going out, extroverted', 'Going to class, doing work, exercising', 'Go into Boston', 'Fun environment with others around my age', 'Anissa Sridhar and Neha Vellanki, yes', 'n/a', 'I play field hockey at Wellesley, and I like goat cheese.', 4, 'Friend', 0, 1, 1, '2015-03-04 20:01:33', '2015-03-06 01:24:13'),
(13, 'Anissa', 'Sridhar ', 'female', 20, 'asridhar@wellesely.edu', '5086544993', 'Wellesley College', 3, 'I am not a brother', 'MIT UROP ', 'chill extrovert ', 'doing homework', 'go into boston ', 'somewhere in a good location with cool people', 'Ellie Manon, Hannah Brewster, Neha Vellanki, Kit Rosen, Hannah Creutzfeldt, i would like to live in the same room ', 'N/A', 'I play field hockey ', 4, 'IFC Website', 0, 0, 1, '2015-03-06 01:52:32', '2015-03-06 02:15:54'),
(14, 'Ellie', 'Mannon', 'female', 20, 'emannon@wellesley.edu', '2055330288', 'Wellesley College', 3, 'I am not a brother', 'I have a summer internship at MGH in a transplant research lab. ', 'I''m very outgoing and enjoy laughing and joking around. ', 'I''m usually at work during the days in the summer. ', 'Usually I go in to Boston at least once each weekend. ', 'Somewhere with people my age, who enjoy having a good time. ', 'Hannah Brewster, Kit Rosen, Anissa Sridhar, Neha Vellanki', 'N/A', 'I play lacrosse and am a breakfast enthusiast. ', 4, 'Friend', 0, 1, 1, '2015-03-06 01:53:00', '2015-03-06 02:15:52'),
(15, 'Neha', 'Vellanki', 'female', 20, 'nvellank@wellesley.edu', '4083489614', 'Wellesley', 2, 'I am not a brother', 'I''m doing a UROP in neuroscience at MGH', 'I''m really outgoing and social and I get along with most people. ', 'Doing homework with my friends or training for field hockey.', 'Go out to a frat or a finals club. I''ll also sometimes go to a game or a concert.', 'I would want to live somewhere that''s not too expensive and with other college students. ', 'Yes! Anissa Sridhar, Ellie Mannon, and Hannah Brewster and we would want to room together.', 'I have never stayed in a fraternity before.', '', 4, 'Friend', 0, 0, 1, '2015-03-06 02:41:56', '2015-03-06 02:58:37'),
(16, 'Caitlin', 'Crawford', 'female', 20, 'cmcrawford@wellesley.edu', '2077761809', 'Wellesley College', 3, 'I am not a brother', 'I am a research lab intern at Joslin Diabetes Center which is located in Longwood medical area. ', 'I would say I am very flexible when it comes to plans, yet I am very outgoing and social. I am very on top of being neat. ', 'Typically as a neuroscience major and a duel sport varsity athlete my weekdays are spent around staying on top of my work and going to bed early. ', 'Sports, but in the summer I spend most of my time at my summer house in Chatham, Cape Cod. ', 'Clean, friendly, and sociable. ', 'Teryn Mitchell ', 'N/A', 'I''m excited for the potential to live in the house for the summer! ', 2, 'Friend', 0, 1, 1, '2015-03-08 01:48:06', '2015-03-09 17:50:53'),
(17, 'Irene', 'Brockie', 'female', 20, 'irenebrockie@hotmail.com', '0873116302', 'Trinity College, Dublin, Ireland', 1, 'I am not a brother', 'Waitressing, located in the Boston area', 'outgoing, friendly, organised, open to new experiences, I love meeting new people!', 'At university, going to class, spending time with friends, in the library', 'Meet friends I don''t see during the week, catch up on work, work as a waitress', 'Somewhere with a great atmosphere, in a great location near shops and amenities, somewhere in a safe area near good nightlife, restaurants, parks etc. Also somewhere filled with friendly people!', 'Eimear Flynn and Catherine Hearn, and yes I would.', '-', 'I''m an Irish student travelling to Boston this summer with two female friends and we would really love to live at DKE! We are friendly, outgoing and hoping to make great friends and memories!', 3, 'Web Search', 0, 0, NULL, '2015-03-08 12:09:52', '2015-03-08 12:09:52'),
(19, 'Fiona', 'Heaney', 'female', 19, 'fhheaney@wpi.edu', '4018552357', 'Worcester Polytechnic Institute', 2, 'I am not a brother', 'Interning at Kiva Systems in North Reading, MA', 'Laid back but always up for meeting new people', 'Typically in classes and studying in places that allow me to take a break and socialize, followed by going to the gym and attending meetings', 'During the school year: catch up on sleep, laundry, socializing, homework, and go out to a fraternity party. \r\n\r\nIn the summer: go to the beach or work', 'This is my first time living away from home for the summer so I''m mainly looking for a place where I''m surrounded by people my age who have similar ambitions and goals for themselves. ', 'Not currently but I may have a few friends from WPI who may express interest in DKE in the near future. ', 'N/A', 'Many of my friends at WPI are affiliated with different IFC organizations and I''m no stranger to the housing arrangements, and would be a laid back person to have in the house. ', 3, 'IFC Website', 0, 1, 1, '2015-03-11 02:06:50', '2015-03-11 05:25:57'),
(20, 'Courtney', 'Peterson', 'female', 19, 'cpeters4@wellesley.edu', '8609180020', 'Wellesley College', 2, 'I am not a brother', 'tentatively taking classes at Harvard', 'outgoing, funny, easy-going, energetic', 'hanging out with friends', 'go out with friends to a party ', 'surrounded with nice people, fun and a good atmosphere', 'Ellie Mannon\r\nAnissa Sridhar\r\nNeha Vellanki\r\nHannah Brewster', 'no', 'I play field hockey and lacrosse at Wellesley', 4, 'Friend', 0, 1, 1, '2015-03-11 02:41:16', '2015-03-11 05:25:56'),
(21, 'leigh', 'murtagh', 'female', 19, 'murtaghupvcwindows@eircom.net', '3876957295', 'dublin city university', 0, 'I am not a brother', 'bar/waiting staff', 'outgoing', 'college and study', 'after work socialize', 'fun and safe', 'no', 'no', 'hard working and like to mix with others', 2, 'Web Search', 0, 0, NULL, '2015-03-11 19:52:37', '2015-03-11 19:52:37'),
(22, 'Aaron', 'Brown', 'male', 21, 'aaronbro@andrew.cmu.edu', '8622168402', 'Carnegie Mellon Univerisity', 3, 'I am not a brother', 'I will be a software development Intern with Charles River Development in Burlington Massachusetts. ', 'I am a laid back guy. I do not like chaos, messiness, or noisiness, though I can tolerate it in moderation. I am fairly social, and can get along with just about anyone. ', 'I typically exercise, read, do homework, and cook several meals for my self. ', 'Attend a sporting event. Go with friends to the bars to watch sports and have fun. ', 'I would like to live in a city with good people, good food, and opportunities for fun experiences. ', 'No.', 'No.', '', 2, 'Friend', 0, 0, NULL, '2015-03-12 17:24:03', '2015-03-12 17:24:03'),
(23, 'Zachary', 'Robbins', 'male', 20, 'zrrobbins@wpi.edu', '5084557252', 'Worcester Polytechnic Institute', 2, 'I am not a brother', 'Kiva Systems - Software Engineering Intern\r\nNorth Reading, MA', 'Laid back, likes to go on spontaneous trips, easy to talk to, likes meeting new people', 'Full time student, going to class, afterwards attending meetings for clubs and hanging out with brothers at my fraternity (Sigma Pi) house', 'Go out to another fraternity (or stay at my own) to party, I like to talk in a more social setting more than just loud music and dancing. Sometimes go on random trips with friends, sometimes just hang out and have a lazy weekend watching movies and such.', 'A place where I can come home from work on the weekdays and relax, talk with some friends, maybe go out to dinner. Then on the weekends, go out and explore the city and go to new places, and have a good time during the night if we feel up to it.', 'Fiona Heaney, didn''t plan on living with her though', 'Have not stayed over any fraternity besides my own.', '', 3, 'Friend', 0, 1, NULL, '2015-03-13 22:30:11', '2015-03-13 22:30:11'),
(24, 'Jeremy', 'Noller', 'male', 21, 'jnoller93@gmail.com', '9784603076', 'University of Maryland, College Park', 3, 'I am not a brother', 'I will be working as a Quantitative Systems Pharmacologist for Pfizer, which is located in Kendall Square. ', 'I would describe myself as very outgoing and social. I am in a fraternity at the University of Maryland.', 'When I''m not doing homework, I''m usually either hanging out with my friends or playing sports such as basketball, football, or soccer.', 'When I am at school, I usually do work during the day and then, at night, I''ll go to a party or a bar. ', 'A clean, convenient, and accommodating house where I would be able to meet new people while working in Kendall Square.', 'No', 'No', '', 2, 'Web Search', 0, 0, NULL, '2015-03-14 00:43:38', '2015-03-14 00:43:38'),
(25, 'Nikhil', 'Patel', 'male', 19, 'nikhil_patel@brown.edu', '5164040606', 'Brown', 2, 'I am not a brother', 'Internship at Putnam Investments in Boston', 'Sociable, nice, sports fan ', 'Working ', 'Having a good time with friends', 'Somewhere with easy-going, fun people ', 'N/A', 'N/A', '', 2, 'IFC Website', 0, 0, NULL, '2015-03-14 19:06:21', '2015-03-14 19:06:21'),
(26, 'Ashok', 'Rao', 'male', 20, 'raoashok@seas.upenn.edu', '3198832922', 'UPenn / Wharton', 2, 'I am not a brother', 'Engineering Research at Kensho, a fintech startup near Harvard.', 'Outgoing and social, but like time to myself every now and then (hence preference for a single or double).', 'Most of the day at work. Work out 3-4 days a week at night. Read, hang out with friends time allowing.', 'Probably sleep till around 11 or 12, brunch, nap, light work out. Read and work for a bit and go out. ', 'Laid back, but comfortable and generally sociable. Not too far from Harvard.', 'N/A.', 'N/A.', 'N/A.', 2, 'Friend', 0, 0, NULL, '2015-03-14 19:13:07', '2015-03-14 19:13:07'),
(27, 'Abshaar', 'Taj', 'male', 21, 'aat66@cornell.edu', '9172946705', 'Cornell University', 3, 'I am not a brother', 'Consulting internship with Accenture', 'Outgoing', 'Sports, tv, sleeping', 'Play basketball', 'Nice and social', 'No', 'N/a', 'Parking situation', 2, 'Friend', 0, 1, NULL, '2015-03-15 18:08:46', '2015-03-15 18:08:46'),
(28, 'Michelle', 'Geng', 'female', 22, 'mgeng@college.harvard.edu', '7133674498', 'Harvard University', 3, 'I am not a brother', 'Internship at Bain Capital - Sankaty Advisors, located in the Prudential Center', 'Outgoing, but still loves Netflix', 'Schoolwork and extracurricular activities', 'Go to a bar or a party', 'On Memorial Drive :) (My college dorm is also on Memorial Drive). I''m not too picky, would just like a decently clean place and nice people :)', 'Is it possible if my brother, who is in high school, can live with me in a double? He is interested in doing research in Boston this summer but on campus housing is very expensive. It''s okay if you cannot, just wanted to ask. I also have a friend named Alison Zhang who is interning at Sankaty Advisors too and she is also looking for housing, and we would like to live near to each other.', 'N/A', '', 2, 'Web Search', 0, 0, 1, '2015-03-16 03:20:42', '2015-03-16 23:37:15'),
(29, 'Tony', 'Jiang', 'male', 18, 'tony.jiang@yale.edu', '4082183796', 'Yale University', 1, 'I am not a brother', 'I''ll be a software engineer intern at Google''s office in Cambridge right next to MIT.', 'Laid back on the weekdays, outgoing on the weekends.', 'After dinner, I''d usually relax somewhere and read, work, or just hang out with friends.', 'I''d go out and explore the area, screw around with friends at night, or occasionally go party.', 'Quiet (on the weekdays at least), close to the office, air-conditioned, has WiFi', 'N/A', 'N/A', 'Nope', 2, 'Web Search', 0, 0, NULL, '2015-03-16 17:09:17', '2015-03-16 17:09:17'),
(30, 'Cody', 'He', 'male', 20, 'philipcodyhe@college.harvard.edu', '5178626320', 'Harvard', 3, 'I am not a brother', 'Lab research, Harvard ', 'Chill', 'Usually laid back, doing work or climbing at Brooklyn boulders in somerville', 'Pong, slapcup, etc.', 'A big house with a bunch of guys who want to have a good time.', 'N/A', 'N/A', 'N/A', 2, 'Web Search', 0, 0, NULL, '2015-03-17 01:38:54', '2015-03-17 01:38:54'),
(31, 'Raleigh', 'McElvery', 'female', 20, 'rmcelver@bowdoin.edu', '6037699876', 'Bowdoin College', 3, 'I am not a brother', 'I will be a summer intern at the Broad Institute. I will be working in the Communications Group as a science writer.', 'I enjoy hanging out with a diverse group of people. I live in  a triple at Bowdoin and I''m used to being around people/noise/activity all the time.', 'During the school year, I study, socialize and go to cross-country or track practice, depending on the season.', 'Hang out with friends, socialize in larger groups, or have a movie night.', 'Social, safe and clean.', 'No.', 'N/A', 'I am looking for an opportunity to meet new people, live in close proximity to the Broad, and be in a safe environment. ', 2, 'Friend', 0, 1, 1, '2015-03-17 17:54:21', '2015-03-17 19:07:24'),
(32, 'Gabriela', 'Hartman', 'female', 19, 'ghartman@wellesley.edu', '6199550268', 'Wellesley College', 2, 'I am not a brother', 'Research with a professor at Wellesley.', 'I am pretty outgoing and love to meet new people and explore new places. ', 'I normally spend my weekdays playing soccer, watching TV, hanging out with friends, and doing work. ', 'I love to go into Boston on the weekend, either go out to dinner with friends or see a movie. ', 'My ideal place to live would be easy to get to from Wellesley, in a good location within Boston, and is clean, preferably. ', 'Hannah Brewster, Anissa Sridhar, and Neha Vellanki from Wellesley are all looking into living at DKE this summer. ', 'I haven''t stayed in a fraternity over the summer before. ', '', 4, 'Friend', 0, 0, 1, '2015-03-17 18:22:57', '2015-03-17 19:07:25'),
(33, 'Noah ', 'Zweben', 'male', 20, 'njz2104@columbia.edu', '3018285839', 'Columbia University', 2, 'I am not a brother', 'I''ll be working for a start-up called Vibrant Composites in Cambridge. ', 'Really outgoing, laid-back about housing', 'In the summer after work, I love going out to free concerts and other events in the city especially when they involve free food. ', 'Go hiking, more free concerts and free food. ', 'A really social and communal environment ', 'No', 'Nope', 'Really excited to be in Boston and living in the house seems like an awesome way to spend the summer.', 2, 'IFC Website', 0, 0, NULL, '2015-03-19 00:03:54', '2015-03-19 00:03:54'),
(34, 'Nhi', 'Ho', 'female', 20, 'nhiho@college.harvard.edu', '3103827304', 'Harvard', 3, 'I am not a brother', 'Research at BWH', 'Laid back', 'Doing work in my room', 'Run by the river', 'Cheap by the river', 'Nope', 'Nope, but my friend highly recommends it!', '', 4, 'Friend', 0, 0, 1, '2015-03-19 23:56:17', '2015-03-20 00:30:39'),
(35, 'Sorcha ', 'Murray', 'female', 21, 'smurray8@tcd.ie', '0868828472', 'Trinity College Dublin', 3, 'I am not a brother', 'As of yet I am unsure as to what kind of work I will be doing this summer as I am only at the beginning of my application and search for jobs in Boston.', 'I would describe my social preferences as being quite an outgoing person. I love meeting new people and gaining new friends. I love to have an extended group of friends that I can hang out with and partake in various activities and social events. I am a friendly, caring and approachable person. I would also say that I would be easy going and slightly laid back depending on the circumstances.', 'Usually I spend my weekdays attending lectures and studying the relevant material for my course. A few evenings in the week though I play squash and am involved in various societies around college so I also commit some of my time to them. I enjoy these as a break from academic work and also to get the opportunity to socialise with a broad range of people.', 'Usually on the weekend I will catch up with family and friends. I may go for dinner with them or catch a movie in the evening time. Also at the weekend I tend to catch up on any assignments or college work that is needed for the coming week. ', 'I would describe my ideal place to live for the summer as being a nice, friendly and welcoming place with reasonably pleasant living conditions overall. I would like someplace that I feel comfortable in and that has a good balance between being able to have your own space but at the same time being able to interact regularly with others.', 'My friend, Mary Cleary, is also considering living at DKE this summer. I would like to live in the same room as her should the opportunity to live at DKE arise. ', 'N/a. ', 'I am a female Pharmacy student at Trinity College Dublin, in Ireland and will be travelling to Boston this coming summer where I am hoping to work. I am currently looking for a place to live in Boston and was recommended to apply to fraternity houses in the area. I am a friendly, responsible and organised person and hope to embrace the American life this summer. ', 2, 'IFC Website', 0, 0, 1, '2015-03-22 10:06:29', '2015-03-25 04:59:39'),
