(37, 'Daniel', 'Douglass', 'male', 21, 'daniel.douglass@wustl.edu', '6176101619', 'Washington University in St. Louis', 3, 'I am not a brother', 'Cogo Labs in Kendall Square', 'Outgoing and laid-back , like to go out to bars, sports games, but then also chill at nights, watching movies etc.', 'Playing fifa, going out, playing frisbee and skating', 'Go to the park with friends and play sports during the day if its nice out. Go out to bars or clubs at night', 'Laid back environment, friendly kids, ability to hang outside. Close to restaurants', 'Peter Metz, We do not want to room together but would like to be both living in the same place', 'No, but i lived in a fraternity house sophomore year at Washu. I am in AEPi here', 'I would like to live in a single if it is still available ', 2, 'Web Search', 0, 0, NULL, '2015-03-23 18:41:32', '2015-03-23 18:41:32'),
(38, 'Colby ', 'Fugere', 'male', 22, 'colbyfugere@my.uri.edu', '4015756821', 'University of Rhode Island', 4, 'I am not a brother', 'I will be working in the Financial District at Ernst & Young. I will be auditing financial companies such as State Street and John Hancock Insurance', 'I am very outgoing and enjoy meeting new people. I am very easy to get along with but also, very focused on my career. ', 'I spend most of my weekdays working at Textron Inc. in Providence and attending classes around my schedule. ', 'On the weekends, I like to go out with my friends at night. During the day, I like to go hang out or go golfing when the weather is nice. ', 'My ideal place to live allows me to be focused on my priorities such as work during the week and social on the weekends. ', 'Ben Heroux, Jake Schweitzer. I would like to live with one of them in a double. ', 'n/a', 'I was given the link to this housing opportunity from a friend of Seve Esparrago', 2, 'Friend', 0, 0, NULL, '2015-03-24 20:49:39', '2015-03-24 20:49:39'),
