(43, 'Cecilia', 'Sanders', 'female', 20, 'csanders@college.harvard.edu', '4439680151', 'Harvard', 3, 'I am not a brother', 'Planetary science research on Harvard''s campus (Cambridge, MA)', 'Always down for adventures, music, dancing, and high-energy things - but also just as happy having a quiet evening in.  Love being around other people in unfamiliar contexts.', 'Working, generally, with chill evenings watching movies and hanging out.', 'Get a rental car, and take people stargazing out in Western Mass.  Or bouldering.  Anything outside and unfamiliar.', 'A safe place to come home to, full of people who love the process of getting to know fellow people.', 'Don''t know anyone yet.', 'Never stayed in a fraternity over the summer before.', 'I have no gender preferences for rooming.', 4, 'Web Search', 0, 0, NULL, '2015-03-26 06:09:53', '2015-03-26 06:09:53'),
