(55, 'Sebastian', 'Biggam', 'male', 20, 'sebbiggam@gmail.com', '0862168921', 'University of Exeter', 1, 'I am not a brother', 'J1 working visa from Ireland', 'Outgoing, sociable, hard-working, sporty. ', 'Going out, going to the gym, playing soccer, studying.', 'Watch/play sport/ socialise/ BBQ', 'I think its more important about the people you stay with rather than the place. I imagine Delta Kappa Epsilon would suit me and my friends perfectly. We are all looking to meet new people and experience a summer that we won''t forget. I''m convinced that we could get that here. We''re really excited by the prospect.', 'Yes I am travelling from Ireland with 7 other friends. We are a really good group of guys that I promise you would have no problem with. Their names are as follows:\r\n\r\nDavid Baker, David Beamish,  Stephen Beamish,  Jack Ryan, David Boland, Luke Fitzgerald,  Jake Courtney.', 'I have not stayed at a fraternity before.', '', 4, 'IFC Website', 0, 0, NULL, '2015-03-30 23:40:38', '2015-03-30 23:40:38'),
