(65, 'Conor', 'Wuertz', 'male', 21, 'conor.wuertz@gmail.com', '5306010019', 'Brown University', 3, 'I am not a brother', 'Software Engineering in Newton', 'I''m quite outgoing and love bringing people together to do fun things. I''m also quite chill and easy to live with.', 'During the school year I spend a lot of time preparing for class and working on assignments. I also love playing soccer, going to the gym, cooking food, and spending time with friends.', 'I like to go dancing, explore new places, and see performances of any type. I often have to study on the weekends as well, though.', 'I want to live in a friendly environment with pleasant people. Nice facilities and a great location are fantastic pluses. ', 'My friend Ryan Ngoy. If we are placed in a double, I would like to live with him.', 'Nope', 'Nope', 2, 'Friend', 0, 0, NULL, '2015-04-06 21:34:45', '2015-04-06 21:34:45'),
