(68, 'Tim', 'Petri', 'male', 22, 'tapetri@wpi.edu', '7743295507', 'Worcester Polytechnic Institute', 2, 'I am not a brother', 'Intern at Silicon Labs, Congress Street in Boston.', 'Outgoing, looking to meet new people and be social in my free time.', 'During the school year, I am pretty busy with athletics and other commitments aside from the school work. \r\nIn the summer I hope to get spend my free time hanging out at the house, working out and experiencing Boston.', 'Hang out out with friends, work out and definitely party to relieve stress', 'Ideally I do not want to live in an apartment but rather a fraternity house with a social atmosphere and events/activities that bring the people who live there together. While not as important,  proximity to central Boston or transportations that can take me around Boston also makes a place great for me.', 'Himanshu Sahay; yes', 'N/A', 'from Sweden; a total viking', 2, 'IFC Website', 0, 0, NULL, '2015-04-07 15:13:33', '2015-04-07 15:13:33'),
(69, 'Himanshu', 'Sahay', 'male', 19, 'hsahay@wpi.edu', '5085020001', 'Worcester Polytechnic Institute (WPI)', 2, 'I am not a brother', 'I''ll be working as a Software Engineering Intern at Monster in Weston, MA.', 'Outgoing, always looking to meet new people and up for new experiences.', 'I split my day between class, homework, club meetings and hanging out with friends. During the summer, I''d spend a lot of the day at work and then go to the gym. I''d spend the rest of the day either at the house or I''d go out.', 'I normally hang out with friends during the day and go out on weekend nights.', 'My ideal place for the summer would be a relaxed yet social environment in a spacious, comfortable house.', 'Yes, I''d like to live with Tim Petri, who has also applied for summer housing at DKE.', 'I haven''t stayed at fraternity over the summer before.', '3 semi interesting facts \r\n- I''m from Dubai.\r\n- I''m really into the startup world and started the Entrepreneurship Club at WPI.\r\n- I''ve lived in a Cambridge apartment last summer while interning there and was incredibly bored, which is why I''m looking to live at DKE this year, on a friend''s recommendation.', 4, 'Friend', 0, 0, NULL, '2015-04-07 15:45:25', '2015-04-07 15:45:25');
