(70, 'Katie', 'Link', 'female', 20, 'klink2@jhu.edu', '3148007305', 'Johns Hopkins University', 1, 'I am not a brother', 'Research Assistant under the Division of Neurotherapeutics at Harvard/MGH', 'Laid-back but social', 'Studying, low-key hanging out', 'Go out into the city', 'Somewhere where I could meet more undergraduates and have a fun summer', 'Katie Awh (a friend at Princeton), yes I would like to live in the same room ', 'No', '', 2, 'Friend', 0, 0, 1, '2015-04-07 17:47:25', '2015-04-07 18:04:47'),
(71, 'Mike', 'Root', 'male', 21, 'Mroot@umass.edu', '9786607803', 'University of Massachusetts, Amherst', 4, 'I am not a brother', 'I am going to be an intern at Grant Thornton LLP. The office is located at 75 State Street, Boston MA 02110', 'My social preference is definitely outgoing. I''m always easygoing and get along with mostly everyone. But, as I am going to be working full time this summer I''ll definitely be prioritizing work on the weekdays/nights, so any potential roommates don''t have to worry about noise during the week. ', 'I am going to be working 9am-5pm every Monday to Friday from June 1st until mid-August. ', 'I''m a big fan of going out in the city at night. I also have some friends living in Boston this summer so I''m sure I''ll be hanging out with them a lot. I live about 1 hour outside of the city (Lancaster) so I''ll occassionally make a trip out there. ', 'MIT frat house, obviously. No but seriously the location/price couldn''t be better for my job. I''m not bothered by having roommates so I''m up for any type of room.', 'Nope, I don''t know anyone. ', 'I haven''t stayed at any of the other houses. ', 'I am a brother of Phi Sigma Kappa at UMass Amherst. After living in a fraternity house for 2 years, I know exactly how it operates and exactly how to respect the living space. I also was suggested this house by a good friend of mine who is a DKE brother at Rutgers Universty. This house would be ideal. \r\nI also don''t have a huge preference on a room type. I will take whatever is open.\r\nLastly, I put my US phone number down but email would be preferable. I am currently studying abroad in the UK and my US number doesn''t work right now. ', 3, 'Friend', 0, 0, NULL, '2015-04-07 18:13:36', '2015-04-07 18:13:36'),
(72, 'Alison', 'Savage', 'female', 20, 'asavage2@wellesley.edu', '2076531993', 'Wellesley College', 2, 'I am not a brother', 'not sure yet, but hoping to be doing graphic design work in Wellesley', 'laid back but social', 'working for most of the day (sometimes into the night), then relaxing later in the evening/night', 'Go to a museum or restaurant with friends, hang out in a park downtown, etc.', 'comfortable, safe, and not too rowdy', 'Isabel Staccuneddu, yes', 'I have not stayed in a fraternity over the summer before', '', 2, 'Web Search', 0, 0, NULL, '2015-04-07 20:58:06', '2015-04-07 20:58:06'),
(73, 'Manudeep', 'Suresh', 'male', 21, 'ns2@illinois.edu', '2175524361', 'University of Illinois at Urbana-Champaign', 3, 'I am not a brother', 'Summer internship at Intel. Hudson, Massachusetts', 'I am an extrovert and I tend to to be outgoing and lively most of the time. But if there is something that needs to be done, I can ignore any form of distraction.', 'I normally spend my weekdays working on a project or studying till midnight and then watching TV or chilling with my friends after.', 'Play soccer or basketball.', 'Decently social but not over-the-top.', 'N/A', 'N/A', 'I like playing basketball and soccer a lot.', 2, 'Friend', 0, 0, NULL, '2015-04-08 14:17:34', '2015-04-08 14:17:34'),
(74, 'Daniel', 'Benson', 'male', 21, 'djbenson@wpi.edu', '8022493809', 'Worcester Polytechnic Institute', 3, 'I am not a brother', 'Software Engineering intern at Silicon Labs. It is located near the north end of Boston', 'I am very easy going and sociable. I enjoy going out on the weekends and hanging out.', 'Working, working out, doing homework, playing frisbee and hanging out with friends in free time', 'I like to go out on weekend nights and relax during the day. I also enjoy hiking or trips to the beach during the days on weekends.', 'Somewhere that is close and has easy commute to work. Somewhere that is close to amenities and attractions in Boston. And somewhere I can meet new people and enjoy the social life in Boston', 'Himanshu Sahay and Tim Petri are applying.', 'Not over the summer but I am a Phi Kappa Theta brother at WPI', 'I am a rising senior majoring in computer science. I am a member of the Ultimate Frisbee A team. I would also love a parking spot if available this summer.', 2, 'Friend', 0, 1, NULL, '2015-04-08 19:43:15', '2015-04-08 19:43:15'),
(75, 'Michael ', 'Noonan ', 'male', 20, 'mnoon070@mail.endicott.edu', '5084237135', 'Endicott College ', 3, 'I am not a brother', 'The Four Seasons Hotel Boston, intern in the sales, marketing and public relations department ', 'Outgoing and adventurous. I''m currently in Switzerland studying abroad where I came to an international hotel school by myself where I''ve met some cool people from all over the world. ', 'I''ll usually spend my weekdays watching/playing sports with friends ', 'Love to get outside and enjoy the nice weather when its warm. I love to chill and play sports but love to go out at night and I''m always down for a nice day drink when the opportunity presents itself. ', 'I''d like to be able to meet some new people who enjoy being social and like to go out. I''d like a place where I can toss around the football or play some ncie corn hole. I''d like to get my work done and do a good job at my internship but I''m very interested in socializing. ', 'no', 'none', 'I''m in hospitality, I know how to be hospitable with everyone. Let me live here so I can show you the tricks of the trade...', 2, 'Friend', 0, 0, NULL, '2015-04-08 20:25:07', '2015-04-08 20:25:07'),
(76, 'Sam', 'Williams', 'male', 22, 'sam.williams@byu.net', '2816380965', 'Brigham Young University', 2, 'I am not a brother', 'Deloitte- Assurance, Boston', 'Outgoing, amiable', 'Working / studying', 'Sports & outdoors, community events', 'Cool people, convenient location', 'No', 'No', '', 4, 'IFC Website', 0, 0, NULL, '2015-04-08 22:23:35', '2015-04-08 22:23:35'),
(77, 'Veronica', 'Bunn', 'female', 22, 'v.bunn@stat.fsu.edu', '8594899199', 'Florida State University', 0, 'I am not a brother', 'PhD intern in Biostatistics division at Genzyme, in Cambridge.', 'Very laid back, down for just about anything. ', 'Work, happy hour, work more. ', 'An ideal Saturday is: \r\n1) Brunch\r\n2) Beach \r\n3) Bar\r\n4) Bed\r\n\r\nAnd an ideal Sunday is napping. ', 'I''ve never lived in the Boston area before, so I would prefer somewhere that''s filled with people that know the area and can make good recommendations on where to go, and come with if they want!\r\n\r\nAlso, I''m a poor grad student, so cheap is good. \r\n', 'Nope. ', 'N/A', 'I make a fantastic jalapeno margarita! \r\nAlso, I can do backflips. Which is a much less useful skill unfortunately. ', 2, 'Other', 0, 0, 1, '2015-04-09 00:49:12', '2015-04-09 01:39:56'),
(78, 'Austin', 'Shin', 'male', 21, 'ashin01@college.harvard.edu', '8136900482', 'Harvard', 3, 'I am not a brother', 'MIT Lincoln Labs, group 9\r\nLexington MA but there is a shuttle from the MIT campus', 'laid back but looking to meet people', 'Training for rowing team, work, listening to good music, personal electronics projects', 'row boats, go to bars, personal electronics projects', 'A place that has ambitious people looking to hang out and meet one another ', 'Andrew Mauboussin, I would like to be near him, but we both are ideally looking for our own bedroom', 'Never', '', 2, 'Friend', 0, 0, NULL, '2015-04-09 00:55:28', '2015-04-09 00:55:28'),
(79, 'Andrew', 'Mauboussin', 'male', 22, 'ammaub@college.harvard.edu', '2036444540', 'Harvard', 3, 'I am not a brother', 'Software Engineering at Kensho in Harvard Square', 'laid back, outgoing', 'Hanging out', 'Have some beers and watch a movie, go to a party', 'Social and friendly', 'I am friends would Austin Shin and would want to live with him', 'No', '', 2, 'IFC Website', 0, 0, NULL, '2015-04-09 01:00:28', '2015-04-09 01:00:28'),
(80, 'Katie', 'Awh', 'female', 20, 'kawh@princeton.edu', '6158292227', 'Princeton University', 2, 'I am not a brother', 'I have a three-month-long medical research position at Massachusetts Eye and Ear Infirmary.', 'I''m very social but also like downtime to relax. Im warm, enthusiastic, and excited to explore Boston and make new friends.', 'The school year is pretty busy, so the average week usually has a lot of studying and meals with friends.', 'Definitely catch up on sleep! Also go to parties, the gym, and the library.', 'I''m happy living wherever as long as I can be with friends. I hope that by living in a frat house I can hang out with other college students during the summer. It will be much more fun than living alone in an apartment!', 'Hopefully I can live with my friend Katie Link. She applied earlier and already heard back from you.', 'n/a', 'Looking forward to meeting you guys! :) ', 4, 'Friend', 0, 0, 1, '2015-04-09 01:14:47', '2015-04-09 01:36:20'),
(81, 'Yaovi', 'Akakpo', 'male', 24, 'brilliant.akakpo@gmail.com', '7202432281', 'University of Denver, Daniels College of Business', 0, 'I am not a brother', 'I will interning an Ad agency called Mullen, located in Boston.', 'A good combination of outgoing and laid back. I''m up for most things and pretty down to earth. ', 'At the moment, school and work. When I have some time, I love playing pick up basketball/football and my PS3. If not those, I hang out with friends and family. ', 'Hangout with friends and maybe go out for a bite downtown. ', 'This will be my first time in Boston. I would love to be in a place that allows me to explore the city and a decent price. ', 'No I do not.', ' I have not', 'Nothing I can think of at the moment. ', 2, 'Friend', 0, 0, NULL, '2015-04-09 02:29:26', '2015-04-09 02:29:26'),
