(83, 'Natalie', 'Pudalov', 'female', 20, 'npudalov@colgate.edu', '9145825756', 'Colgate University', 2, 'I am not a brother', 'I am going to be interning at Julie''s Family Learning Center in South Boston.', 'I would say that I am extroverted but a secret introvert! I am outgoing, positive, and relaxed.', 'During school, I spend my weekdays going to classes, studying at the library, and exercising!', 'Catch a movie and hang with friends.', 'A place where young people come together and enjoy the summer!', 'No, not yet!', 'I have not.', 'I am really looking forward to the summer!', 2, 'Friend', 0, 0, 1, '2015-04-10 14:40:16', '2015-04-10 18:10:44'),
(84, 'Isabel', 'Staccuneddu', 'female', 20, 'istaccun@wellesley.edu', '6317048824', 'Wellesley', 2, 'I am not a brother', 'Non-profit economic research in Cambridge', 'Outgoing, laid-back, friendly, kind', 'I can be found studying, at the gym, or at frisbee practice!', 'I usually have tournaments, but I''ll go out with my teammates after.', 'A place where I can relax after work and get to know people from other colleges.', 'Alison Savage.  Yes, and we are also open to quads.', 'N/A', '', 2, 'Friend', 0, 0, NULL, '2015-04-10 16:50:58', '2015-04-10 16:50:58'),
