(86, 'Hannah', 'McLaughlin', 'female', 20, 'hannahmclaughlin@college.harvard.edu', '7815001374', 'Harvard College', 2, 'I am not a brother', 'boutique investment banking - 1 Broadway Street in Cambridge', 'super chill and very social', 'work, psets, hanging out with friends, psets...', 'explore restaurants around the Square, go with friends to Queenshead Pub, relax outside', 'Ideally, I would love to live in a very relaxed atmosphere with cool people with whom I can hang around Boston or just at the house. DKE is also perfect due to its location and beautiful housing!', 'I do not, but one of my friends is possibly considering applying for DKE housing. If she does apply, I would love to room with her. I''m extremely flexible about roommates though and housing.', 'nope', 'I hear I''m an A+ roommate', 4, 'IFC Website', 0, 0, 1, '2015-04-11 21:30:04', '2015-04-11 21:43:47'),
(87, 'Heidi ', 'Wade', 'female', 21, 'wade.heidi@gmail.com', '5417403051', 'Wellesley College ', 3, 'I am not a brother', 'Biochemistry research at Wellesley College  ', 'I''m pretty mellow and laid back ', 'I work during the day and then usually go to workout in the gym in the evenings. ', 'I  go out with friends which usually involves going out to eat and exploring Boston. ', 'I want to spend as much time as possible in Boston this summer so living in the city is most important to me. Other than that I''m looking for a comfortable living environment with interesting people around.  ', 'No. ', 'No. ', 'No. ', 2, 'IFC Website', 0, 0, NULL, '2015-04-12 13:22:55', '2015-04-12 13:22:55'),
