(89, 'Samantha (Sammy)', 'Porter ', 'female', 20, 'Saporter@brandeis.edu', '8609120427', 'Brandeis University ', 2, 'I am not a brother', 'Intern at Massachusetts Health Council in Needham.', 'I would describe my social preferences as outgoing. I love meeting new people and just hanging out. ', 'I would spend my weekdays at my internship. I also like to exercise so I would find time for that during the day as well. ', 'On weekends I would normally go out into the city with friends or visit friends staying in the Boston area.', 'My ideal place to live for the summer would be a social environment with great people in an amazing location (and I think DKE offers just that, being right in Cambridge).', 'No', 'N/a', 'I am actually a sister of Delta Phi Epsilon at Brandeis. Our sorority had a mixer with DKE last semester and unfortunately I was unable to make it, but I have heard many positive things about the brotherhood. One of my sisters is living in the same area this summer for her internship and I think a summer in Cambridge would be an awesome experience. ', 2, 'Friend', 0, 1, 1, '2015-04-13 00:45:32', '2015-04-13 01:21:29'),
