(92, 'Divya', 'Seth', 'female', 22, 'dseth@post.harvard.edu', '5852301617', 'Case Western Reserve School of Medicine ', 0, 'I am not a brother', 'Research at MGH', 'outgoing ', 'going to medical school, saving lives, etc. ', 'explore new places/events with friends, go out, sleep', 'friendly, clean, open, interesting conversations', 'No....', 'N/A', 'I''m a recent Harvard College alum (Class of 2014) and a first year medical student in Cleveland. I''m excited to be in Boston again for the summer. I love to bake! ', 2, 'Friend', 0, 0, 1, '2015-04-13 14:34:28', '2015-04-13 22:02:56'),
