(95, 'Aditya', 'Dhulipala', 'male', 23, 'adhulipa@usc.edu', '2138074043', 'University of Southern California', 0, 'I am not a brother', 'I''m interning as a Web Applications Engineer at Mathworks in Natick, MA. I''ll be working in the advanced code editing and web services integration team.', 'Friendly, outgoing, fun-loving gamer/led-zep fan', 'Mostly at the University. Engineering professors seem to think we have "too much free time". I spend most of my time programming on school projects or hobby/open-source projects', 'I''d go out. Explore the city,. Or stay at home and play games (big fan of Dragon Age and Mass Effect)', 'I''m a an international student in the U.S. I''d be happy to explore any city that has deep historical & cultural significance in America', 'No', 'No', '', 3, 'Other', 0, 0, NULL, '2015-04-14 18:37:47', '2015-04-14 18:37:47'),
(96, 'Sarah', 'Cohen', 'female', 19, 'scohen3@wellesley.edu', '2489244492', 'Wellesley College', 2, 'I am not a brother', 'I''m going to be commuting back to Wellesley College to take summer classes in addition to pursuing internship work in Boston.', 'Outgoing, but can be laid back', 'I normally have an informal schedule where I go to class and take care of other business and personal matters. Occasionally, I will attend several social events during the week.', 'Go to the movies, explore Boston/Cambridge, go out to eat, and go to concerts!', 'Clean and safe!', 'Michelle H. Lee and Julia Han are considering living at DKE this summer. They are also current sophomores and will be pursing UROPs at MIT this summer. I would prefer to live in the same room as them.', 'I have never stayed at a fraternity before.', 'Is there a place where I can keep my car at or nearby the fraternity this summer? If so, how much would that parking spot cost?', 3, 'Friend', 0, 1, 1, '2015-04-14 19:32:35', '2015-04-14 20:38:20'),
(97, 'Mary', 'Struble', 'female', 16, 'rjstruble@yahoo.com', '4437429760', 'Our Lady of Good Counsel HS', 0, 'I am not a brother', 'Intern with Twitter in Kendall Square through Girls Who Code', 'Outgoing, laid back, funny.  Fine in groups or spending time alone.', 'HW or social media after work. Internship will be 9-4 p.m.', 'Run, go to a sporting event, see a movie, shop, go to the beach', 'Friendly, convenient, inexpensive, safe', 'No', 'None', 'Double or triple with other females is fine.  From MD but have family in area.  Will be 17 in September.', 2, 'IFC Website', 0, 0, NULL, '2015-04-14 20:14:51', '2015-04-14 20:14:51'),
(98, 'Isabella', 'Narvaez', 'female', 20, 'inarvaez@wellesley.edu', '2035853154', 'Wellesley College', 2, 'I am not a brother', 'Research at Wellesley College and taking a class ', 'Like going out on the weekends, mostly down time during the week. ', 'Working out, doing work, and hanging out with friends', 'Workout, go out to dinner, go out at night, find things to do in Boston', 'Surrounded by friends and in a fun city', 'Hannah Brewster, Anissa Sridhar, Neha Velanki, Ellie Mannon. Yes I would like to live with them. ', 'NA', 'Im on the Wellesley Track and Field team. I love to dance. ', 4, 'Friend', 0, 0, 1, '2015-04-15 01:44:32', '2015-04-15 03:27:15'),
(99, 'Arlene ', 'Cordoves', 'female', 20, 'arlenecordoves@gmail.com', '7863554298', 'Brandeis University ', 2, 'I am not a brother', 'social work, boston ', 'outgoing ', 'Netflix or with friends ', 'go out with friends, Netflix pizza ', 'somewhere warm but not drenched in sweat ', 'Samatha Porter! She''s applied too! We just learned we were both doing it though so she might not have put me on the app! We are both sister of DPhiE Brandeis. ', 'n/a', 'I am kind and clean! Always down for a good time. ', 2, 'Friend', 0, 0, 1, '2015-04-15 03:38:03', '2015-04-15 04:41:03'),
(100, 'Justin', 'Lai', 'male', 18, 'jzlai@stanford.edu', '5122280367', 'Stanford University', 1, 'I am not a brother', 'Front-end intern at Cuseum, Boston', 'Both, honestly', 'Climb, write, think, program, design', 'Go climbing', 'I don''t need much  just interesting people interested in getting to know each other, who are decently compatible!', 'Nope', 'x', 'x', 3, 'Friend', 0, 0, NULL, '2015-04-15 09:52:33', '2015-04-15 09:52:33'),
