(102, 'Austin', 'Kueffner', 'male', 21, 'kueffner@live.unc.edu', '3363917005', 'UNC-Chapel Hill', 3, 'I am not a brother', 'Consulting for SONOS', 'Outgoing, social, like meeting new people and having a good time ', 'Primary focus on work but like to hang out as well. I enjoy playing basketball and going out about twice a week. ', 'Travel. I like to make trips and do something unique almost every weekend', 'Social, but with people who are focused on completing something whether it be summer school or internships', 'No, but I can recruit other SONOS interns if things work out. ', 'Well I am in a fraternity at UNC, so I am familiar with the the environment, however, not at MIT', '', 2, 'Friend', 0, 1, NULL, '2015-04-15 22:31:14', '2015-04-15 22:31:14'),
