(110, 'Nathan ', 'Walton ', 'male', 20, 'nathantwalton@gmail.com', '5154234357', 'Washington University in St. Louis ', 2, 'I am not a brother', 'Organic chemistry at the other school ', 'Mix of outgoing and laidback depending on the context - definitely enjoy having a good time. I''m a brother of another fraternity at WashU and enjoy the lifestyle that  it brings with it. ', 'Going to class, working, working out, studying, and going out or doing something at the house should I have the time. ', 'I usually try and get out and do something non-school sponsored, as in see the city - go out to dinner, try out a new bar, or just explore. I also attend most of the nightly social events put on by my fraternity. I also try to get out once a month to go camping, climbing, fishing, or hiking somewhere to break it up. ', 'Nice, easy-going social group of people who are friendly and courteous - who do their own things during the day but also enjoy doing things at night. As for actual living conditions, a bed and someplace to put my minimal belongings is all I need. A kitchen is an added perk. ', 'No, but I have someone (emilie.neez@wustl.edu) who is doing the same thing as me and is interested in getting a double together. ', 'n/a', 'I''m always down to cook and help out in any regard - I''ve done some house managerial stuff for my fraternity and know all it takes to keep things running. ', 2, 'IFC Website', 0, 0, NULL, '2015-04-16 23:42:26', '2015-04-16 23:42:26'),
