(121, 'Yooni ', 'Choi', 'female', 22, 'yschoi@umd.edu', '2407509839', 'University of Maryland, CP', 4, 'I am not a brother', 'Internship with Health Leads in the financial district', 'I like to both stay in and to go out. I am laid back about a lot of things and love having conversations with people. Regardless of what I am doing during the time I am home, I am super respectful of keeping common areas clean and being responsible for my own space. ', 'Interning, working out, hanging out, cooking, watching TV', 'Exploring the city, going out with friends, staying in to watch Netflix, working out', 'A place that can be both fun and quiet depending on the atmosphere and what people are doing that day', 'No', 'None', 'My friends have had housing at the MIT frathouses, so I''m looking forward to staying here. My friend, Gholson Glass, was also in LCA at MIT if that counts for anything. ', 3, 'Friend', 0, 0, 1, '2015-04-19 02:35:52', '2015-04-19 03:03:27'),
