(123, 'Paul', 'Rogofsky', 'male', 20, 'ropa@sas.upenn.edu', '5167761593', 'University of Pennsylvania', 2, 'Delta Kappa - University of Pennsylvania', 'I will be a software engineering intern at Wayfair this summer. The company is located in Back Bay.', 'I''m pretty outgoing. I like to chill (play video games, watch tv) and go out on weekends.', 'During school, I''ll usually just do homework. During the summer, I try to lift or play basketball every day, and then relax/watch tv for the remaining time before I go to sleep.', 'I''ll go to a party at night usually one day. Otherwise, I will mainly just hang out, play video games, or play basketball.', 'A good place to live this summer would have people I can just hang out with when I''m bored. I am in DKE at Penn, and it''s awesome to just leave my room and hang out with my brothers.', 'No I don''t know anyone else living at DKE.', 'No', '', 3, 'Friend', 0, 0, 1, '2015-04-19 18:18:13', '2015-04-22 17:34:32'),
