(139, 'Bailey', 'Graves', 'female', 20, 'bgraves@colgate.edu', '3154056529', 'Colgate University', 3, 'I am not a brother', 'I am working at a non-profit called Heading Home which fights homelessness in Boston. It is located at 529 Main Street #100, Boston. ', 'I can be either given the situation. I like me time, but I also like to socialize and really enjoy new roommates.  ', 'Weekdays I go to work, hangout at a park or go for a walk and then settle down to cook dinner and binge watch netflix. ', 'On a weekend I would barbecue or go to a farmers market (often both) and explore. ', 'My ideal place to live is somewhere where I can socialize when I want to, but still have somewhere to chill with headphones in and relax. ', 'I do not. ', 'I have not. ', 'I like cooking for large groups of people and meeting new people. ', 4, 'IFC Website', 0, 1, 1, '2015-04-22 17:00:02', '2015-04-22 17:32:06'),
(140, 'Danielle', 'Putur', 'female', 21, 'dputur@colgate.edu', '6034932430', 'Colgate University', 3, 'I am not a brother', 'This summer I am a Manzi Fellow with Colgate University which means I will be doing nonprofit work at Boston Healthcare for the Homeless. The branch of BHCH that I will be located at is on Albany Street in Boston.', 'I would say that I am a laid back personality, up for whatever is going on around me. I am always happy to meet new people but also appreciate a quite night in with friends.', 'On the weekdays I anticipate having long hours at work, so after getting back from work I usually go on a run, make dinner, and then either hang out with my friends or relax around the house.', 'Having grown up near the north shore, I spend most of the weekends during the summer relaxing on the beach during the day, and hanging out with my family or friends at night.', 'This summer I am looking for a relaxed and open environment where I can meet new people and enjoy Boston.', 'Bailey Graves', 'No, I have not.', 'I selected quad but I''d be happy in either a triple or a quad.', 4, 'Friend', 0, 1, 1, '2015-04-22 19:59:57', '2015-04-22 20:22:49'),
(141, 'Christina', 'Chen', 'female', 20, 'cgc3@williams.edu', '2408932772', 'Williams College', 3, 'I am not a brother', 'I will be doing research in Richard Gregory''s lab at Boston Children''s Hospital.', 'I''m pretty outgoing and enjoy hanging out with people, but I also appreciate having some time to myself. ', 'I have a pretty science-heavy schedule right now, so most of the time I''m in lab or doing problem sets. I also teach at the local elementary school and tutor.', 'Sleep...I also like to head outside when the weather is nice and go to the occasional party with my friends. ', 'Somewhere centrally located and close to public transportation so that I can explore the area on the weekends. ', 'Nope. ', 'Nope!', 'Nothing for now, thanks!', 4, 'Friend', 0, 0, 1, '2015-04-23 21:24:26', '2015-04-23 22:29:52'),
(142, 'Shu Yun(Gina)', 'Liu', 'female', 19, 'ginaliu@mit.edu', '2672748858', 'MIT', 1, 'I am not a brother', 'UROP -- Koch Institute ', 'chill & laid back\r\nshy at first, but talkative once I got to know the person', 'class, UROP, p set', 'dance (ADT)', 'somewhere I can gain a different experience than dorm life', 'Sibo Wang\r\nYes, I would love to get a double with her', 'N/A', '', 2, 'Friend', 0, 0, NULL, '2015-04-24 03:51:28', '2015-04-24 03:51:28');
