(143, 'Michael', 'Powell', 'male', 24, 'mpowe027@fiu.edu', '3055103506', 'Florida International University', 3, 'I am not a brother', 'Summer research in Dr. Dan Gilbert''s lab at Harvard University', 'Outgoing but shy at first.', 'Monday through Friday I will be working all day.', 'Normally I''d go to the beach with a few friends, however in the Boston area, I''m excited to explore the city.', 'Honestly, it would be a colonial city like Boston. Being from Florida, I''m not used to the history behind a city and I''d love to be able to experience it without the cold winters. ', 'No.', 'N/A', '', 4, 'IFC Website', 0, 0, NULL, '2015-04-24 13:27:39', '2015-04-24 13:27:39'),
(144, 'sibo', 'Wang', 'female', 18, 'sibowang@mit.edu', '9739324356', 'MIT', 1, 'I am not a brother', 'I''m uroping with a phD student at Sloan this summer.', 'laid back', 'Mostly just work and surf the internet', 'I like exploring Boston with friends on the weekends', 'a place where all the residents are friendly and chill and the facilities are clean', 'Gina Liu and I would like to room with her', 'no', '', 2, 'Friend', 0, 0, NULL, '2015-04-24 21:06:53', '2015-04-24 21:06:53'),
(145, 'Andrea', 'Plat', 'female', 21, 'ap654@cornell.edu', '3054091182', 'Cornell University', 3, 'I am not a brother', 'R&D internship at Gillette', 'I like to go out on weekend nights, but will be staying in during the week', 'If I don''t have to study, I hang out with my housemates or go out.', 'If the weather is nice, I like to spend time outside or if I have to stay in during the day I''ll just hang around with friends or watch TV.', 'Somewhere with cool people I can hang out with, but I also need to be able to focus on my internship during the week. On weekends, I''d like to be able to explore Boston and meet new people.', 'Pujaa Rajan (also from Cornell)  might be applying.', 'No', '', 2, 'Friend', 0, 0, 1, '2015-04-24 22:08:47', '2015-04-25 01:54:00'),
(146, 'Carolyn ', 'Yao', 'female', 20, 'cyao42@gmail.com', '9172240301', 'Duke University', 2, 'I am not a brother', 'Startup, incubating at the Harvard Innovation Lab', 'chill, a fan of spending time outdoors (literally)', 'will be working weekdays, but hopefully peaceful, pleasant evenings earlier in the week with cooking and working out and nights out later in the week', 'Spend the daytime on a hobby, catching up on conversations, spending the nighttime out in town', 'Affordable, accessible, with people of my age who share some of my interests', 'Nope', 'N/A', 'Flexible about room sizes that cost less than the single (single may be expensive for me)', 3, 'Web Search', 0, 0, NULL, '2015-04-26 03:13:04', '2015-04-26 03:13:04'),
(147, 'Mallory', 'Ham', 'female', 20, 'mham1@babson.edu', '2032470832', 'Babson College', 2, 'I am not a brother', 'I am interning at Entercom in Brighton', 'I''m a pretty laid back person, easy to talk to, pretty organized and can definitely stay out of the way. I''m also definitely up for some cooking with friends!', 'I''ll be working every week day. Tuesdays and Thursdays will be 9 am -5 pm and the other days are to be determined.', 'I''m going to try to work most weekends, but if I am not I''ll usually hang out during the day, go out to lunch, go shopping, and at night go out. ', 'I want to be surrounded by new people to make friends with and have a good time with. I am definitely looking for a fun, social atmosphere as well as place that I can come home to and relax.', 'My friend Lexie is considering living in DKE this summer and I would room with her.', 'I have not.', 'I am a very hard working person and will keep my areas clean.', 2, 'Friend', 0, 1, 1, '2015-04-26 17:11:45', '2015-04-26 22:46:54'),
(148, 'Alex', 'Chou', 'male', 21, 'alexander_chou@brown.edu', '7034720567', 'Brown University', 4, 'I am not a brother', 'Software Engineer at nToggle (startup)', 'Laid back and loyal', 'Watching/playing sports and coding', 'Go out to dinner, go shopping with friends, go to socials', 'Easy access to the city, near other college students', 'No', 'No', 'Not really', 2, 'Friend', 0, 0, NULL, '2015-04-26 23:17:42', '2015-04-26 23:17:42'),
(149, 'Carey', 'Mott', 'male', 21, 'careykmott@gmail.com', '2039624385', 'University of Colorado Boulder', 3, 'I am not a brother', 'Interning at the Federal Reserve Bank of Boston downtown.  ', 'Laid back, reserved but social, need my quiet time every now and then.  ', 'Working most of the day, then usually evenings with friends and reading at night.  ', 'Depending where in the country I am, usually fly fishing, sailing, rowing, and visiting with friends.  ', 'Quiet but still lively, clean, safe.  ', 'No.  ', 'N/A ', 'Im fairly reserved, enjoy reading, writing, sailing, and rowing, and will spend most weekends on camping/fishing trips or traveling to New York and DC to visit friends.  ', 2, 'IFC Website', 0, 1, NULL, '2015-04-27 05:34:53', '2015-04-27 05:34:53'),
(150, 'John', 'Potter', 'male', 20, 'j.potter1@nuigalway.ie', '0877623992', 'National University of Ireland Galway', 2, 'I am not a brother', 'Unknown, we will be job hunting on arrivial, most likely in restaurants and bars', 'outgoing', 'college, playing sports and hanging out with friends', 'go out, watch games', 'central to services and city, clean living environment, and a good atmosphere', 'Joe Healy, Kevin Lee, Cian De Lamport and yes we would like to share a quad room', 'no', 'We''re all friendly hard working irish students visiting Boston for the summer on a J1 work and travel visa', 4, 'Web Search', 0, 1, NULL, '2015-04-27 14:38:50', '2015-04-27 14:38:50'),
(151, 'Deirdre', 'Plaus', 'female', 22, 'dplaus@colgate.edu', '3035226718', 'Colgate University', 4, 'I am not a brother', 'Marketing, Financial District', 'Outgoing!', 'Working', 'Going out, exploring Boston', 'Friendly people, clean, fun, safe', 'Allie Schneider--we would prefer two singles but would be willing to share a double', 'N/A', 'N/A', 2, 'IFC Website', 0, 0, 1, '2015-04-27 18:28:28', '2015-04-30 00:02:07'),
(152, 'Alice', 'Lee', 'female', 18, 'elee19@wellesley.edu', '4125088647', 'Wellesley College', 1, 'I am not a brother', 'MIT Research - AgeLab', 'Outgoing', 'Hanging out with my friends, exploring Boston/studying.', 'Go to friends'' parties in the city. ', 'A friendly and clean environment. Accessibility to work.', 'No', 'No', 'I''m pretty chill. I also wouldn''t mind a triple.', 4, 'Friend', 0, 0, NULL, '2015-04-28 00:18:58', '2015-04-28 00:18:58'),
(153, 'Philippa', 'Haven', 'female', 20, 'philippahaven@comcast.net', '6178332657', 'Scripps College ', 2, 'I am not a brother', 'I will be interning at Charles Group Consulting in downtown Boston, as well as conducting independent economic research on women in the labor market. ', 'I am outgoing, and love to be social. However I do take my work seriously, and hope that the house can be a place to unwind after work. ', 'Besides working 9-5 I like to cook, work out/go for runs, watch T.V., read, and just hang out and talk with people. ', 'Something active outside, like hiking, going to the beach, or attending a music festival. Sometimes I will attend a few parties and entertain people, but low-key weekends are also fun. ', 'A social place, where people are respectful and relatively neat. I understand there will be people with different work schedules, and I hope everyone will be respectful of others in regards to common, shared spaces. I''d also like to get to know the other people living in the house, and hope that throughout the summer we can get to know each other!', 'N/A', 'N/A', 'I am really excited to be interning and researching in Boston this summer! I have some friends that will be in the Boston area, and hope to make more this summer! ', 2, 'Friend', 0, 0, 1, '2015-04-28 04:05:50', '2015-04-29 00:46:53'),
(154, 'Jakub', 'Kaczmarzyk', 'male', 21, 'kaczmarj@union.edu', '5163537736', 'Union College', 3, 'I am not a brother', 'Neuroscience research at MIT (Laura Schulz''s lab)', 'Easy-going but also outgoing.', 'Practicing the piano, hanging out with my friends, doing cog neuro research, and doing homework.', 'I would go on a 20-50 mile bike ride with my best friend.', 'Close to MIT, clean, and decently priced.', 'Yes, Adrianna Ratajska. I would like to share a room with her.', 'N/a.', 'I can play the piano for you.', 2, 'Friend', 0, 0, NULL, '2015-04-28 05:35:42', '2015-04-28 05:35:42'),
(155, 'Judene', 'Thomas', 'female', 20, 'thoma23j@mtholyoke.edu', '4136579936', 'Mount Holyoke College', 2, 'I am not a brother', 'Internship in the Brookline area', 'I am pretty laid and quite.', 'I will be at work.', 'I would normally go to church or watch tv, hang out with friends or attend events.', 'Somewhere that is quite, serene and very relaxing. ', 'No', 'I have not stayed in a fraternity before.', '', 4, 'Web Search', 0, 0, NULL, '2015-04-28 18:13:08', '2015-04-28 18:13:08'),
(156, 'Karen', 'Moorthi', 'female', 18, 'kmoorthi@wellesley.edu', '5856439902', 'Wellesley College', 1, 'I am not a brother', 'I''m going to be researching in the Spencer lab at Beth Israel Deaconess ', 'I''m pretty laid back, and usually down for anything ', 'Over the summer, I''ll probably spend most of my time during the day in the lab, and the rest of the time in the evening either around the house hanging out, or out in Boston.', 'I''m usually either catching up on work, or out exploring the city', 'Some place with a welcoming community where people are down to hang out together after their days', 'N/A', 'I''ve never spent the summer in a frat', 'Looking forward to hearing from you guys! ', 2, 'IFC Website', 0, 0, 1, '2015-04-28 21:23:39', '2015-04-30 00:02:11'),
(157, 'Sarah', 'Meyers', 'female', 21, 'sjm342@cornell.edu', '9498385022', 'Harvard University', 0, 'I am not a brother', 'I am taking classes through Harvard Extension School.', 'I would say I''m pretty laid back - I lived in a co-op for 2 years in college so I''m definitely used to living with a lot of people.', 'School, volunteer stuff, working out, etc.', 'Go to bars with friends', 'Conveniently located, fun/social, relatively cheap', 'Nope', 'N/A', '', 2, 'Web Search', 0, 0, NULL, '2015-04-28 22:06:53', '2015-04-28 22:06:53'),
(158, 'Andrew', 'Adams', 'male', 18, 'adamsa@mit.edu', '9198869406', 'MIT', 2, 'I am not a brother', 'I will be UROPing with the MIT AeroAstro department on campus. ', 'I will most likely not be hanging out at DKE very much if I stay there. I am outgoing and generally very intense about what I do. ', 'I will spend them in lab followed by playing games, reading, and hanging out with friends on campus.', 'Go to Boston, sleep in, play games, read', 'I would most likely spend most of my day outside of where I live,  so the ideal place for me would be somewhere that I can come in at any hour (literally) and sleep or work or read. I also enjoy company, so having people that I can talk to is important to me as well. ', 'Rachael Devlin, and no ', 'No, but I have stayed at Theta Xi over CPW.', 'I am loud as a roommate. I like rockets, planes, physics, and music. ', 4, 'Friend', 0, 0, NULL, '2015-04-29 02:31:19', '2015-04-29 02:31:19'),
(159, 'Brandon', 'Klugman', 'male', 21, 'brandonklugman@gmail.com', '9528367172', 'American University', 3, 'I am not a brother', 'Summer internship -- location will be finalized in the coming weeks', 'Laid back during the week, outgoing on weekends', 'Going to class, and work, eating meals with friends, doing homework and watching sports.', 'Hang out/drink with friends, watch/play sports, do homework, go out to eat.', 'My ideal place would be somewhere where I am living with nice, easy going people who are friendly and like to have a good time.', 'No', 'No', 'I am a kind, laid back person who likes to meet people and have a good time. I am a big sports fan and like to play pick up basketball.', 2, 'IFC Website', 0, 0, NULL, '2015-04-29 06:17:52', '2015-04-29 06:17:52'),
(160, 'Zachary ', 'Brown', 'male', 20, 'zbrown@friars.providence.edu', '9787643167', 'Providence College', 2, 'I am not a brother', 'interning at Mass Dems', 'outgoing frindly', 'studying, working community service', 'video games, hanging with friends', 'a reasonably priced space with other people around ', 'no', 'no', 'not really', 3, 'Web Search', 0, 0, NULL, '2015-04-29 11:10:31', '2015-04-29 11:10:31'),
(161, 'Barbara', 'Terwilliger', 'female', 20, 'bmt2128@columbia.edu', '6178175788', 'Columbia University', 4, 'I am not a brother', 'Not decided yet', 'I am very social and laidback. Love being around people even if its just sitting around doing work together.', 'Normally wake up early to work out, go work, after work relax by reading, playing guitar, hanging out with roommates ', 'Biking along Charles River, walking around downtown, at night going out with friends. ', 'I am looking for a place that is relaxing and a great hang out spot. I love being productive, so am usually looking to relax when I come home. I have many siblings so love being around many people and am used to sharing things and space with others. ', 'I have someone who is considering living with me, but she is not entirely sure yet if she will be in Boston for the summer. ', 'NA', 'NA', 4, 'Web Search', 0, 0, 1, '2015-04-29 14:08:10', '2015-05-01 23:25:21'),
(162, 'Alex', 'Faura', 'female', 20, 'afaura@wellesley.edu', '6264833666', 'Wellesley College ', 2, 'I am not a brother', 'I will be working with a nonprofit group to help create lobbying campaigns the company is located near Boston Common', 'Pretty outgoing', 'Hanging out with friends', 'Go out into the city', 'A place with an exciting city and a beach nearby', 'Yes. Chelsi Scott, Hannah Brewster, Ellie Mannon, Anissa Sridhar \r\nIf possible yes! ', 'No', ' ', 2, 'Friend', 0, 0, 1, '2015-04-30 03:43:59', '2015-05-01 23:25:22'),
(163, 'Jack', 'Curtis', 'male', 60, 'jack.curtis.31415@gmail.com', '6035605473', 'MIT', 0, 'I am not a brother', 'Doing a Launch Academy boot camp in Boston, Chinatown, need a place to limit commute during Monday to Thursday', 'I''m old. (obv.), pretty laid back, tolerant.', 'I''ll be doing a lot of work as the boot camp on Ruby on Rails is likely intense.', 'Ski, cycle, visit girlfriend', 'fairly quiet, friendly people who are working hard on themselves or a project', 'no', 'Hahahaha.  Pi Lambda Phi (i''m a brother) a LONG time ago.', 'My major need is to have a place to stay that is convenient and allows me to study, crash, etc. without returning to Acton, MA every night.', 2, 'Friend', 0, 1, NULL, '2015-04-30 17:01:14', '2015-04-30 17:01:14'),
(164, 'Connor', 'Van Cleave', 'male', 20, 'cvancleave@colgate.edu', '2015665483', 'Colgate University', 2, 'I am not a brother', 'I will be working at Youth Centers with the Music and Youth Fellowship in Boston.', 'I am friendly and outgoing. I am in a fraternity at Colgate.', 'Doing homework, going to parties, or just hanging out with friends.', 'Go to a party, play a gig, play basketball/workout.', 'Being in a fraternity at Colgate, I really like the idea of spending the summer in a fraternity house. I enjoy community living, and MIT is very convenient for where I will be working.', 'Justin Newman, and we would like to be roommates.', 'I have not stayed in a fraternity over the summer before.', 'I am an easygoing guy, and I will not be a problem of any kind. ', 2, 'IFC Website', 0, 1, NULL, '2015-05-01 00:25:47', '2015-05-01 00:25:47'),
(165, 'Luis', 'Uribarri', 'male', 43, 'uribarri@alum.mit.edu', '6465932809', 'MIT', 0, 'I am not a brother', 'IT, BofA', 'I pretty much get along with anyone.', 'Work, Visiting Hanscom AFB', 'Travel to NYC and Philadelphia', 'Something simple, something inexpensive.', 'N/A', 'DU, like way back in like 1992', 'Dear Summer Housing Coordinator:\r\nI am writing to officially request information regarding the availability of summer housing for 2015.\r\nI am an MIT Alumni who is looking for an inexpensive place to stay in the Boston area for the summer of 2015. Considering the current costs of housing in the Boston area, the possibility of renting a room at one of the MIT Fraternities would be an absolute bargain.\r\nA little bit about myself:\r\nI graduated MIT course 11 back in 1998 (yes, class of 1998), I have been up and down the east coast ever since, I was a New York City resident for a significant portion of that time. (Including survival of the 9/11 attacks). I currently work in Cyber Security for a major Financial Institution and the position allows me flexibility of where I can live and work.    \r\nSo why am I looking for a room in an MIT fraternity for the summer? \r\nAs in my previous statement, cost is definitely a factor, but most importantly I am hoping to obtain summer housing in the Boston area for the following reasons:\r\nMy younger brother, who is active duty military, is currently stationed at Hanscom Air Force base. He lives on base with his wife and 2 children (my niece and nephew). My brother has just received his orders for deployment and will be headed to Afghanistan within a few weeks. His deployment is expected to last 6 months. My younger brother has asked for me to provide support for his family by staying in the Boston area while he is away.  I figure if I can stay in Boston for the summer, and visit his family regularly during the summer, it would provide them with the needed support and comfort during what will be an obvious period of difficulty and stress.\r\nIn any case, I look forward to your response as to whether or not you still have any spaces for rent.  Although not absolutely necessary, a parking spot would be a great benefit as well. \r\n\r\nSincerely,\r\n\r\nLuis Uribarri\r\n1998 Course 11\r\nuribarri@alum.mit.edu\r\n', 2, 'IFC Website', 0, 1, NULL, '2015-05-01 06:51:58', '2015-05-01 06:51:58'),
(166, 'Varnel', 'Antoine', 'male', -5, 'varnel.antoine@gmail.com', '7812283756', 'Harvard', 3, 'I am not a brother', 'MGH, lab research', 'laid back', 'I will be working in lab 40+ hours', 'Go to the bar. watch tv', 'It would be similar to a dorm experience where there are social students my age around that is close to where I''m working.', 'no', 'no', '', 2, 'IFC Website', 0, 0, NULL, '2015-05-01 08:57:07', '2015-05-01 08:57:07'),
(167, 'Annie', 'Jachthuber', 'female', 19, 'Jachthuber.1@osu.edu', '4047710504', 'The Ohio State University', 2, 'I am not a brother', 'This summer I will be rowing for Riverside boat club, and I will also be working in the Cambridge area.', 'I am pretty laid back and I tend to get along with all types of people.', 'I am an athlete at Ohio State so I  normally spend my weekdays going to practice and classes and in the evening I like to relax and watch Netflix or do homework. ', 'On the weekends I normally go out to dinner or see a movie with my friends. I also make sure to save time to organize my room and get caught up on my school work. ', 'I am looking for somewhere that the people will be friendly and respectful. The ideal summer place is somewhere that is clean and affordable to be honest.', 'No', 'I have never stayed in a fraternity before.', 'I am kind, funny, and respectful. I hope to find a nice person to room with this summer.', 2, 'IFC Website', 0, 0, 1, '2015-05-01 17:45:08', '2015-05-01 23:22:54'),
(168, 'Dylan', 'Moore', 'male', 21, 'dmoore2@stanford.edu', '5103324325', 'Stanford', 4, 'I am not a brother', 'I will be working as an cs intern at Google.', 'social but chill', 'I am on the running club, enjoy practicing guitar, hanging out with friends, and writing fiction stories. ', 'Explore someplace I''ve never been with a friend.', 'Surrounded by fun, interesting, and motivated young people', 'I don''t know anyone else working at my Google office yet or living in the Boston area, but I am excited to make new friends', 'none', 'Please send me an email if you have any questions, or if there is no space in your house over the summer, if you have any other suggestions of places to stay I would really appreciate them. Thanks so much!', 2, 'Web Search', 0, 0, NULL, '2015-05-02 07:54:24', '2015-05-02 07:54:24'),
(169, 'Nicholas', 'Bahnson', 'male', 20, 'nicholas_bahnson@brown.edu', '9199713617', 'Brown University', 3, 'I am not a brother', 'Business Development at a start-up called ACEA in the Harvard iLab', 'Outgoing but enjoy some time to myself', 'Doing work, going to the gym, playing video games', 'Go out with friends to house parties and the occasional club', 'A DKE fraternity house', 'I know Jake Rosenfeld and Nathatn Giacalone we would like to live together', 'I live in a fraternity house during the school year', '', 3, 'Friend', 0, 1, NULL, '2015-05-03 00:35:04', '2015-05-03 00:35:04'),
(170, 'Jacob', 'Rosenfeld', 'male', 20, 'jacob_rosenfeld@brown.edu', '3109263852', 'Brown University', 3, 'I am not a brother', 'I am working at OnShape, a software company in cambridge.', 'mostly laid back, video games/tv/programming.  Occasional night out.', 'programming for CS projects, rugby practice 3x a week', 'go to house parties with friends, host Game of Thrones viewing parties', 'Somewhere in cambridge convenient to the Red Line ', 'Nick Bahnson and Nathan Giacalone are also applying, and we all hope to live together in DKE.', 'I have not stayed in one over the summer, but am a member of Delta Tau, and live in-house during the year', 'N/A', 3, 'Friend', 0, 0, NULL, '2015-05-03 00:35:09', '2015-05-03 00:35:09'),
(171, 'Nathan', 'Giacalone', 'male', 21, 'nathan_giacalone@brown.edu', '9783994243', 'Brown University', 3, 'I am not a brother', 'Working at a startup in cambridge called Mineral Tree', 'Time to but myself but outgoing', 'Rugby practice and work', 'Lacrosse and going out with friends', 'Definitely a DKE fraternity house', 'Nicholas Bahnson and Jacob Rosenfeld', 'I live in a fraternity house during the year', '', 3, 'Friend', 0, 0, NULL, '2015-05-03 00:40:01', '2015-05-03 00:40:01'),
(172, 'Kimberly', 'Yu', 'female', 18, 'kimbeeyu@mit.edu', '6266770269', 'MIT', 1, 'I am not a brother', 'I''ll be working as a web programmer for the Build in Progress UROP at the Media Lab.', 'I consider myself an extraverted introvert, am very laid-back, and am comfortable spending time by myself or with a small group of people.', 'Besides going to classes, I also play ultimate frisbee, practice playing the guitar, and meet up with friends for meals/psetting.', 'I go to church on Saturdays, occasionally go shopping on Sundays, and throw frisbees with friends.', 'Somewhere within walking distance to campus that is safe, clean, organized, and full of friendly and interesting people. ', 'No', 'None', 'I am a really chill person that loves playing ultimate frisbee. I am also a Christian and have an identical twin sister.', 4, 'IFC Website', 0, 0, NULL, '2015-05-03 02:47:51', '2015-05-03 02:47:51'),
(173, 'John', 'Niroula', 'male', 19, 'jniroula@mit.edu', '2132108361', 'MIT', 2, 'I am not a brother', 'UROP at MIT', 'introvert at heart who became an extrovert', 'watch a movie, do homework, play some tennis', 'watch a movie', 'Place that has fun activities and fun people', 'No', 'N/A', '', 2, 'IFC Website', 0, 0, NULL, '2015-05-04 04:28:07', '2015-05-04 04:28:07'),
(174, 'Will', 'Armero', 'male', 19, 'armerow@gmail.com', '2032786145', 'Skidmore College', 2, 'I am not a brother', 'Interning at the center for alzheimer research and treatment at Brigham and Women''s Hospital', 'I like to go out on occasion, but I also enjoy just hanging out.', 'I work, train for crew, hangout', 'Explore the city, go for a long bike ride or run', 'In the middle of the city', 'Isabella Narvaez, she already has a room, so no.', 'No', '', 2, 'Friend', 0, 1, NULL, '2015-05-04 20:06:54', '2015-05-04 20:06:54'),
(175, 'Erica', 'Zhang', 'female', 21, 'zzhang4@wellesley.edu', '3392047164', 'Wellesley College', 3, 'I am not a brother', 'Continuing the research I''ve been doing during the semester in MIT materials science research project and work on research job in organic synthesis at MGH.', 'I focus on work during week days, but like to have fun during weekends, party or hang out with interesting people etc.. ', 'Mostly busy with classes and research bench work.', 'Go to movies, have drinks with friends, hang out with friends, do sports (sailing, horseback riding), lots of gym, etc..', 'A clean and tidy environment that could help me focus in academia. Also a fun space to hang out with friends. Of course air conditioning is very important.', 'No I don''t. ', 'No I haven''t.', '', 2, 'Friend', 0, 0, 1, '2015-05-05 00:39:27', '2015-05-05 03:02:53'),
(176, 'Valerie', 'Lanzone', 'female', 21, 'vlanzon@emory.edu', '9122220246', 'Emory University', 4, 'I am not a brother', 'I''ll be working for IBM as a World Wide Performance Marketing Intern for Security. ', 'Very outgoing, and down to earth. President of my sorority, Alpha Delta Pi at Emory. ', 'I will be working during the week. ', 'I enjoy sailing, running, and exploring. Looking forward to getting to know the city. ', 'Looking to meet other college kids and excited to be working for IBM, so this sounds wonderful to me. ', 'Nope ', 'Nope ', '', 2, 'IFC Website', 0, 0, 1, '2015-05-05 16:15:13', '2015-05-05 17:04:25'),
(177, 'Michael', 'O''Connor', 'male', 22, 'mkoconno@andrew.cmu.edu', '6315135625', 'Carnegie Mellon University', 4, 'I am not a brother', 'Interning for Automation Engineering Inc in Wilmington, MA', 'Outgoing, Social', 'Relaxing after work and unwinding', 'Travel; exploring different portions of Boston and the northeast', 'A relaxed environment with friends around to hang out and socialize with ', 'My friend Bryce Beisswanger and I would be looking to be roommates', 'No', 'I am a member of Sigma Phi Epsilon and Bryce is a member of Sigma Chi here at CMU so we both know how great being in a fraternity environment can be.', 2, 'IFC Website', 0, 1, NULL, '2015-05-06 00:37:54', '2015-05-06 00:37:54'),
(178, 'Htoo Tint', 'Wai', 'female', 20, 'hwai@smith.edu', '3475670761', 'Smith College', 2, 'I am not a brother', 'I am doing research in the chemistry department in Boston University.', 'I''m quiet and easy-going. ', 'I go to class and do my work.', 'I would usually stay indoors, but I like to go out and get a snack sometimes.', 'A nice, cozy place where there are friendly people.', 'I don''t know anyone else.', 'I have never stayed in a fraternity house.', 'I won''t be staying for the whole summer. I am only interested in staying from late May until late July.', 4, 'Friend', 0, 0, NULL, '2015-05-06 03:08:58', '2015-05-06 03:08:58'),
