(182, 'Amy', 'Qiu', 'female', 20, 'yqiu2@wellesley.edu', '4256478003', 'Wellesley College', 3, 'I am not a brother', 'Data Science Intern at CDK Global''s Cambridge office located at Autotegrity\r\n198 Broadway\r\nCambridge, MA 02139.  I will also most likely be doing research with an MIT CSLI professor ', 'friendly introvert', 'homework, sleeping, answering the neverending barrage of emails.', 'sleeping in, chores, cooking, art, shopping, watching game of thrones or Doctor Who', 'A place with inspirational people who are kind, respectful, and generous.  Amenities-wise, you''re perfect.  I just hope there aren''t mosquitos, cockroaches or snoring roommates. ', 'Not at the moment\r\n', 'I am looking forward to the first time I stay in a fraternity over the summer.', 'I am open to any size room that you have available.  ', 2, 'Friend', 0, 0, NULL, '2015-05-08 03:45:52', '2015-05-08 03:45:52'),
