(184, 'Sohum', 'Patnaik', 'male', 19, 'sp12@williams.edu', '5105793646', 'Williams College', 1, 'I am not a brother', 'Data Analytics at Journal of Medical Insight (JoMI). JoMI, a tech startup located at 101 Arch Street, Suite 1950, is a surgical video journal/virtual operating theatre.', 'Chill and laid back.', 'Hang out with friends after I get my work done.', 'Hanging out, going out,  and parties. Both chill and crazy nights are great. I also have recently been getting really into outdoorsy things, so the weekends of the past few months have involved lots of backpacking trips, canoeing trips, bouldering, rock climbing, hammocking, and stargazing.', 'Somewhere with great people surrounding me.', 'Nope.', 'Never have, but hopefully that''s about to change ;-)', 'I can''t think of much else you guys need to know about me. However, let me know if you have any questions.', 4, 'Web Search', 0, 0, NULL, '2015-05-09 20:52:12', '2015-05-09 20:52:12'),
(185, 'Stormer', 'Santana', 'male', 21, 'stormer.santana@s-sm.org', '7202801041', 'University of Denver', 1, 'I am not a brother', 'Asset Management @ Fiera Capital USA', 'I am a very laid back, relaxed yet motivated person. ', 'I will be working from 8-6 everyday and will try to workout after work.', 'Being in Colorado, I love hiking and try to go to the mountains as much as possible', 'For my current situation, my ideal summer housing would be in the heart of Boston so that I can be close to work and experience the city.', 'No', 'No', 'I am willing to pay upfront asap.', 2, 'IFC Website', 0, 0, NULL, '2015-05-10 15:29:12', '2015-05-10 15:29:12'),
(186, 'Karen', 'Zirkle', 'female', 21, 'kzirkle@lesley.edu', '8456290608', 'Lesley University', 4, 'I am not a brother', 'Nanny-Central Sq', 'Very outgoing and super chill. I have no problem hanging out with people and just having a good time. ', 'Usually I am either nannying, studying, or just hanging with friends. I''m not too crazy but I''m not too boring either. ', 'Usually I try to go out around Boston and Cambridge to different parties.', 'Clean and with a lot of fun people. ', 'Nope', 'Nope', '', 2, 'Friend', 0, 0, 1, '2015-05-10 23:05:06', '2015-05-11 02:36:41'),
