(188, 'Taylor', 'Ladd', 'female', 18, 'taylorladd@college.harvard.edu', '3402441582', 'Harvard College', 1, 'I am not a brother', 'I will be a research assistant at the Lab for Developmental Studies at Harvard University.', 'I am pretty outgoing, and like to chill and have fun. I enjoy alone time every once in a while but for the most part like to be around people.', 'I usually go to class, eat and hang out with friends, go to sailing practice, and then come back and study/hang out until bedtime.', 'I am usually competing for sailing on the weekends, but on my off weekends I normally watch netflix, go to museums, or go out with friends.', 'I would really like to live in a community that is social, diverse, and really fun to come home to every day.', 'no', 'n/a', '', 2, 'Web Search', 0, 0, 1, '2015-05-11 01:31:37', '2015-05-11 02:36:39'),
