(197, 'Jude Chisom', 'Erondu', 'male', 26, 'eronduj@greenmtn.edu', '8022870773', 'Green Mountain College', 4, 'I am not a brother', 'Unpaid Summer Internship with the  Millennium  Campus Network (MCN) located at 101 Huntington Ave. Suite 2205 Boston, MA 02199. As Director of Operations', 'Very outgoing with strong interpersonal skills ', 'Friends apartment/ social night like pub and night clubs', 'Go on a walk, watch movies, and participate in sporting activities', 'A place very vibrant and hot!!!', 'None', 'This would be my first time to stay in a fraternity house. I have been looking for an opportunity to start one at my school, but haven''t had the opportunity. But I have served my college in different leadership roles such as student senate as President, Judicial Review Board Member, and Director of Civic Engagement. ', 'You can look me up on  LinkedIn via https://www.linkedin.com/in/erondujudechisom', 4, 'Web Search', 0, 0, NULL, '2015-05-14 12:40:47', '2015-05-14 12:40:47'),
