(200, 'Kristin', 'Fong', 'female', 19, 'fong_kris@bentley.edu', '2032407565', 'Bentley University', 3, 'I am not a brother', 'I will be interning with SThree located on State Street in Boston. This is a global recruitment and business sales agency.', 'Very outgoing and friendly, love to meet new people. Always out with my other sorority sisters or friends on the weekends.', 'Will be working 8-5. Besides that, hanging out with friends. Love to try new restaurants and watch movies.', 'Social events with my sorority (previously I was social chair). ', 'Easy commute to work, around lots of people my age who are interested in having a fun summer together!', 'N/A', 'N/A', 'Member of Alpha Phi at Bentley (Zeta Rho Chapter). From Brewster, NY. Very involved with Greek life at Bentley! Economics-Finance major with a liberal studies major in Global Perspectives. Favorite hobby is to travel, going abroad to Brussels this fall for the semester. ', 2, 'IFC Website', 0, 0, 1, '2015-05-16 10:47:38', '2015-05-16 14:41:17'),
(201, 'Peter', 'McGahren', 'male', 19, 'psm92@cornell.edu', '2017045716', 'Cornell', 2, 'I am not a brother', 'I''m doing Software Development at IBM in Littleton, MA', 'Outgoing', 'I''m involved in a few clubs on campus that keep me busy.', 'Planning/organizing events. I''m my fraternity''s social chair.', 'I don''t know many people in Boston/Cambridge so somewhere I can meet new people quickly.', 'N/A', 'Briefly stayed in my fraternity house (FIJI) for a few weeks last summer.', 'I don''t have a room preference. Any available spot works. I know it''s late but I only recently received the offer letter.', 4, 'IFC Website', 0, 1, NULL, '2015-05-16 18:34:34', '2015-05-16 18:34:34'),
