(208, 'Jennifer', 'Stryker', 'female', 20, 'jennymarienator@gmail.com', '4154647649', 'Wellesley College', 3, 'I am not a brother', 'I''m going to be working at the YWCA in Boston, near the Prudential Center.  I will be an intern in Marketing and Fund Development.', 'I think I''m pretty laid back--I like to hang out with old friends, but I also love meeting new people.', 'Most weekdays I spend (when not in class) doing stuff around campus--eating or cooking with friends, reading outside, or doing some work with friends during the school year.  ', 'I like to spend the days of my weekends doing something outdoors--whether that''s hiking or biking or simply walking around the city.  At night, I like to host or go to parties, or just simply hang out with friends and a few beers.', 'My ideal place to live for the summer would be somewhere comfortable and fun, in Cambridge which I love.  I''d love to make new friends this summer and live in a relaxed, positive environment.', 'N/A', 'N/A', '', 4, 'Friend', 0, 0, NULL, '2015-05-27 23:57:03', '2015-05-27 23:57:03'),
