(46, 46, 'Alex', 'Warner', '', NULL, 'I attended Pope John XXIII High School before coming up to MIT.  I play offensive guard and center for the football team.', 'Football', 'Chilling, lacrosse, fishing', 'Oakland Raiders', 'Notre Dame', 'Hunt for the Red October', '"Dictionary is the only place that success comes before work. Hard work is the price we must pay for success. I think you can accomplish anything if you''re willing to pay the price." - Vince Lombardi', 'Rockaway, New Jersey', '2015-01-26 06:13:25', '2015-01-26 06:13:25'),
(47, 47, 'Laith', 'Maswadeh', '', NULL, 'Laith is an MIT freshman who aspires for world domination. He also enjoys long naps and absolute silence.', 'Football', 'Sleeping', '', '', '', '', 'Fountain Valley, California', '2015-01-26 06:13:25', '2015-01-26 06:13:25'),
(48, 48, 'Joseph', 'Cunningham', '', '', 'I was born in Memphis, TN and then moved to Chicago, where I graduated from St. Ignatius. I play football and will likely play rugby here at MIT.', 'Football, Rugby', '', 'St. Louis Cardinals, Chicago Bears', '', 'Pulp Fiction', 'Only a man who knows what it is like to be defeated can reach down to the bottom of his soul and come up with the extra ounce of ower to win when it is even--- Muhammad Ali', 'Chicago, IL', '2015-01-26 06:13:26', '2015-01-26 21:07:41'),
(49, 49, 'Luther', 'Banner III', '3147045256', 'lvbanner@mit.edu', '', 'Football', 'Music, Sports', 'St. Louis Cardinals, St. Louis Rams, and LA Lakers', 'Missouri Tigers', '', '', 'St. Louis, MO', '2015-01-26 06:13:26', '2015-03-16 16:18:17'),
(50, 50, 'Christopher', 'Sparano-Huiban', '', '', 'I am Christopher Sparano-Huiban and I grew up in Stamford, Connecticut. I play football as an offensive line man and I intend to study civil engineering.', 'Football', 'Model Trains, Fishing', 'New York Giants', '', 'Miracle', '"It''s kind of fun to do the impossible." -Walt Disney', 'Stamford, Connecticut', '2015-01-26 06:13:26', '2015-01-26 08:56:10'),
(51, 51, 'Geoffrey', 'Hegg', '6106398028', 'ghegg@mit.edu', 'I grew up in the suburbs outside of Philadelphia. I love all aspects of football, playing and watching it. I play offensive line for the Engineers. Other than football my other passion is singing and theater. I''m a fairly easy going and nice guy and will help when needed. I''m looking to major in Course 6-3 (Computer Science)', 'Football, Theater', 'Music, Video Games, Board Games', 'Philadelphia Eagles', 'MIT Engineers', 'Forrest Gump', '', 'Devon, PA', '2015-01-26 06:13:26', '2015-02-13 02:38:06'),
(52, 52, 'Joseph', 'Hanley', '', '', 'Joe was born and raised in New York. He plays offensive line for MIT and plans on studying computer science. Some refer to him as Mongo, and claim that his days consist solely of eating, smashing things, and speaking in the third person. These claims are false and slanderous. Joe is a scholar and a gentleman.', 'Football', 'Basketball, Video Games, Picking up and putting down heavy things', 'New York Giants', '', 'Pulp Fiction', '"Do, or do not. There is no try." - Yoda', 'Somers, New York', '2015-01-26 06:13:26', '2015-01-29 23:10:43'),
(53, 53, 'Andres', 'Wallentin', '', NULL, 'Andres''s reputation precedes him, like lightning precedes thunder. The ancient Mayans prophesized his birth. As a baby, he taught others how to walk. At the tender age of 7 he quit school, because the teacher called "Recess," and he doesn''t play. At the less tender age of 12 he was pronounced dead for the first time.', 'Football, BGSA, MITI, ORIGAMIT, TMRC, USWIM', 'Hobbies: Films, Cooking, Puzzles, Pina Coladas, Getting Caught in the Rain', 'Washington Redskins', 'Aztecas Universidad de las Americas Puebla', 'Watchmen', '', 'Mexico City, Mexico', '2015-01-26 06:13:26', '2015-01-26 06:13:26'),
(54, 54, 'Seve', 'Esparrago', '3146062726', 'Eaparrs@mit.edu', 'I was born and raised in Saint Louis, Missouri. I graduated from Saint Louis Priory School, and I play football for MIT.', 'Football', '', 'Saint Louis Cardinals', 'MIT Engineers', 'Good Will Hunting', '"The greatest pleasure in life is doing what others say you cannot do."', 'Saint Louis, MO', '2015-01-26 06:13:26', '2015-02-19 17:55:30'),
