(77, 77, 'Raoul-Emil', 'Khouri', '', '', 'I was born on April 3rd 1996, in St. Louis, Missouri. Shortly after I moved to Key Biscayne an island 3 miles east of Miami. I grew up in Key Biscayne as the youngest of five siblings. Now I am at MIT studying computer science.', '', '', '', '', '', 'Impossible is just a big word thrown around by small men who find it easier to live in the world they''ve been given than to explore the power they have to change it. Impossible is not a fact. It''s an opinion. Impossible is not a declaration. It''s a dare. Impossible is potential. Impossible is temporary. Impossible is nothing.  Muhammad Ali', 'Miami', '2015-01-26 06:13:27', '2015-05-04 00:36:27'),
(78, 78, 'Michael', 'Delaus', '', '', '', '', '', '', '', '', '', 'Andover, MA', '2015-01-26 06:13:27', '2015-04-29 04:22:30'),
(80, 80, 'Marcus', 'Urann', '7744547840', 'marcusu@mit.edu', '', '', '', '', '', '', '"I expect to pass through this world but once. Any good, therefore, that I can do or any kindness I can show to any fellow creature, let me do it now. Let me not defer or neglect it for I shall not pass this way again." - Stephen Grellet', 'Duxbury, MA', '2015-01-26 06:13:27', '2015-02-08 01:14:42'),
